insert into comments values(null, '武秀英', 'f.gpcm@ytdsrqkrv.zr', '1970-03-15 11:31:50', '外影广条同取水权科速工与。矿身面却属次养导务作者用品油调。高石期品极放存斗一号口消别共去。', 'rejected', 6, 4);
insert into comments values(null, '胡娟', 'i.pnrx@jlomfvv.se', '1970-03-23 14:16:57', '采参什正面准观提干在易东统。走部系取团商机酸科往证和流物实则。入程用指学行利划影现清关织方。', 'rejected', 5, 5);
insert into comments values(null, '邵艳', 'k.nsmn@mlskvsgt.cy', '1970-04-19 12:34:27', '国新研目心思力品家织通还如周气长多。话它思造约众系压程它过去全。必导则达发前何西最老四关向。', 'rejected', 2, 5);
insert into comments values(null, '唐军', 'd.qqehe@kqfjqc.at', '1970-04-24 11:22:29', '好联律物联使进很们有严这里月之。实养件矿商除政究定划必火起划六。内百那则变次引持只情车各地织持。', 'approved', 5, 7);
insert into comments values(null, '贾杰', 'h.zfgvacgly@xjhc.kn', '1970-06-02 17:50:24', '般管调对口数系华成着响段道。器方机习因花再收手革派场加你些。你儿主反放按体养题成又全积适业者。世月实集区百一身酸美得分外。长型型记起没好还组事战压近并细周。', 'approved', 4, 3);
insert into comments values(null, '卢霞', 'n.oeklh@tcri.mh', '1970-06-07 07:56:56', '那非际起却养记全律比次选用门。书体科我今直划油还调价片名动。层火例间都也手东上几外内长步分程。也又安太级质研决提米设也天石六接。值制这先支全的亲较利主没区。', 'rejected', 1, 3);
insert into comments values(null, '姚明', 'c.lowpsu@ltbgt.tw', '1970-10-05 03:29:23', '会管效业发满务加院话阶复红。当为长传器因知光被史军争院任近。地划力线然头江议示时位眼政反油。', 'held', 3, 4);
insert into comments values(null, '罗秀兰', 'k.xjilpwwnd@muaaszprj.pe', '1970-11-05 04:32:04', '火放名易期维认研已写族七现现时。专长产发型么省般且利已历去三使。有三常确光华济风一果眼象社际类原京支。完目里验的听心风土量交义多被时要。话你收更例报义青数们状战下化。', 'held', 8, 5);
insert into comments values(null, '魏秀英', 'b.dwigsd@lspo.fj', '1970-11-17 23:13:26', '干生不类据达织效段线经子线料越地展斗。号目海众处亲统西别书型加体车关。家式几议时指新新确同约公联算。圆已道很自口红制发边个才件便方。动济入代易商速持热民点量种准先府。', 'approved', 9, 4);
insert into comments values(null, '吴丽', 'p.uwmxdaerd@reti.biz', '1970-11-21 19:39:46', '东示接家公可斗通建山回带边身作色许。再半个改总九单外者构收看好到。据设王与白把已集术交志难意区支类价。', 'approved', 4, 5);
insert into comments values(null, '谭秀英', 'o.cdlrmtjk@vudqmho.wf', '1970-12-03 04:08:09', '花时该大我县西正华名极千书程它。林级马二状增为六式不近习之强层解区。时值由强义计东两道型意选格。', 'rejected', 4, 4);
insert into comments values(null, '萧刚', 'o.nwom@tliqvcxcrt.ai', '1971-01-24 15:38:33', '克按府王政积头党无任十作下。家张海白面省体形反对便革整近别带为。新说安位至规难完节开方做。都们劳为九须进新专列值般条主入气石。装光经局此得种西权四酸第争小里采类。', 'held', 10, 4);
insert into comments values(null, '张霞', 'y.ucyfvr@pkxb.kz', '1971-05-16 14:45:19', '会拉个标领标极行眼除却快调资际例。百收改话规美较级习由次价制体便。况速们律例油团门人话或较步管约习七。量类断天上题百安采西影外件好开断照。', 'held', 9, 4);
insert into comments values(null, '段芳', 'y.udgpw@ppbr.tel', '1971-05-20 16:12:29', '两江新果题写指么权拉保教自治知群象。目你张计史广次段提热题共光求。分我张油清严打学电上联资。传水接得公该民百理七题众领。响酸离张也数干持回动至文体金路一也。', 'trashed', 7, 4);
insert into comments values(null, '江涛', 'u.xgillj@gysewwbqqh.it', '1971-07-30 13:49:41', '照带济好非反族史月上律准。林可那性音在场少查反细但面称候。科山准一定技无场不那历圆风她步际。自象就积往化王平动和好事存等便。', 'rejected', 6, 2);
insert into comments values(null, '杨霞', 'v.bknq@vipdaxar.sd', '1971-08-23 15:47:35', '委强片准结己斯能年音根同指。度儿无角点接是装再热拉适建党。省月次好系科展才科到议则共阶半用住。量般温场今入料示细厂育国四。', 'trashed', 6, 2);
insert into comments values(null, '宋娜', 'g.fryttpcea@fiouikqcz.gf', '1971-09-04 08:48:25', '备被公维运无如该照力把元种圆江车一。于观本北员公济强业科代革影。派形听名山市据确那拉花由效布把土。研部资把上断离调元较要步。', 'approved', 10, 5);
insert into comments values(null, '丁平', 'l.iueglgra@yet.bh', '1971-09-09 15:39:23', '名音细相交由转将深化求界件加群果。到应最很会前片原重运实先民原。江电家已料线比得很现造该质便。须需越海说白验空断由天效节。', 'approved', 8, 3);
insert into comments values(null, '许军', 'f.qvrno@teayivoy.kp', '1971-09-18 16:23:06', '本同五特元今现高热向单们。际即却飞光色到事设型我增工第。导万部或连应从选农总们确转有。例育回权她就些也矿只样系车品收是精。', 'approved', 4, 3);
insert into comments values(null, '魏军', 'd.yucrtlue@ufgknbgds.ne', '1972-01-26 23:06:55', '究成点信由济价天及论低世八团水。和根也无价统音层山素律提四更平矿龙。当布收建存方置史切是律民没断习义共出。照开适群质张族关到品教选很严。', 'held', 9, 2);
insert into comments values(null, '谭娜', 'z.npslhz@vrpyelj.gw', '1972-02-11 13:47:00', '过解运商圆龙资决转工持想半。油建记所每集里对结国深阶太参亲以许族。引制与条动这展发转每只引书。反成个省有应没动事目看平。同光史术南王号多率准信其作较快飞组风。', 'approved', 5, 2);
insert into comments values(null, '卢洋', 'x.qsfawtkdrd@uqwvwsdk.do', '1972-02-27 02:17:24', '该听间样行当按技适记但交列打集三象。又压必再合效况但角为老变光验。往非时边十红观切年精改见容成他。听总必亲回千级当小产并直。', 'held', 3, 2);
insert into comments values(null, '曾静', 'z.zxswby@emjdnjc.sc', '1972-02-28 01:09:32', '元水权热个布做支去难县油。天学候火本给保学导感压外回。好建部往提建或高命六资十适对。头率确图公名命听你直治样保难花数。影色近近平打对名济较打再细。', 'rejected', 9, 6);
insert into comments values(null, '金磊', 'w.sfk@vvweu.gd', '1972-03-07 04:35:26', '开已矿月化务办世题集习热务内价到。最上产计不直小务见快采效三。指眼记值风装没空证比斗农多电须信强。住且处她连单学生更难展眼工到品论场组。', 'approved', 9, 5);
insert into comments values(null, '夏秀英', 's.sdctrimoo@hqzphmxmt.us', '1972-03-27 03:55:04', '要使组光京说向你管实去记起。角水不型议声走克号者做率实引划济利。使快名天四政同据北电会算七社增验。打整华生里明与求都压消广府但统。矿质须酸热史算世统律去我形入位。', 'trashed', 3, 4);
insert into comments values(null, '沈杰', 'l.zojgusbo@gmzsrch.is', '1972-03-30 23:16:31', '断细家题次争需养办满代过积至论业造。建已八成被心写高人复最片极林有身音听。走开标产外听人期半值具设重区标信前。京青声及酸具拉效下走西力容组往备。非九调何话目战中就至会九员细回采。', 'held', 1, 4);
insert into comments values(null, '邹秀英', 'p.iulxn@ethbh.hm', '1972-07-04 19:35:44', '常历那水务比水须几府领带同。就生子立精合也革元识团型。度点重北报办火改济拉名持验。际更此光什百物划原六务军南标时确调。青精音维总目身第上对已方干支史片发。', 'approved', 9, 1);
insert into comments values(null, '许丽', 'g.zia@eplukymx.vu', '1972-07-19 13:26:23', '业国属使节一共格可知么统性世新式。重整广带内何民和王整他立级始采。与更消好等想由打需发拉如三感属查设。求你断时验易速许事生快此厂对后低地。济产或重装委建离下级青型县较特来。', 'approved', 4, 1);
insert into comments values(null, '袁平', 'o.tlakypk@cnhsewwtci.pro', '1972-08-09 15:13:41', '通听者车图及习便放会千历。点条斯总切节年集近压同该第水。拉从三农传素由需被根上积七不展斯。', 'rejected', 4, 2);
insert into comments values(null, '杜超', 'g.fatsfi@vinmqligc.cc', '1972-08-27 12:09:05', '往期几多或一众法保个国式往少华及最。进始土细国理感化许结打至。与百往表第本认她起意应五最文府。', 'approved', 9, 4);
insert into comments values(null, '戴明', 'k.yojwjiq@yshvlew.kz', '1972-09-30 02:26:46', '其活号受张然小列角色件至率做就始例。设路军往完将多育住维两上参上。率九听根七油队何参元清新克际住。图局节社派能公能几报局应物后上很。任海上价民片马同知过被飞公水。', 'approved', 2, 1);
insert into comments values(null, '龙静', 's.hgrubc@zaqaugxkf.br', '1972-10-03 03:40:40', '比料七与何即点两则没例资与都。目亲劳联权图得值造半状眼样决段。计第而应报六龙见织特按府她局因军新史。决太林土要南花工图并精什传。', 'trashed', 5, 5);
insert into comments values(null, '谭刚', 'w.kvmgrmy@dwrqlle.zm', '1972-10-10 10:36:21', '重养重我气前队转养世京书打几光又。件看需龙斯于和许展究公报千段线知连。数证严技片子领须山机明积眼出场图。间看准人济展安办周接写整。', 'held', 4, 1);
insert into comments values(null, '廖桂英', 'k.xhnyu@jrh.eg', '1972-11-01 04:54:47', '验里将手历国为领保受复小边。龙器二应路容明级小了团面快快才。打进五现办正上究管效精先空广十。', 'held', 2, 6);
insert into comments values(null, '宋刚', 'a.rmvmwb@lkslglh.so', '1972-11-29 21:58:07', '一话些地在个全原世九你米走论。水及拉区状响相去做听观下山。取感公口方传积取回必采值一劳听。', 'held', 5, 7);
insert into comments values(null, '彭超', 'v.bhpxdkxj@orhfrbqc.fr', '1972-12-30 05:54:36', '风重议华加海头金做到日按支。线斯何管很界员气化调两日农其近报军派。平影信养生办由点化厂单往备。方过在里主角准系等平叫小命称。', 'approved', 7, 1);
insert into comments values(null, '孙平', 's.olabtn@vbaivu.ki', '1973-01-15 10:55:33', '又维又美所例物出权有成步直导。意类只领个能年型些资低决思表使根月。值时族花要总质不广响王北确便十。一商社证段分方清世族江易间速。好实路于品状外听思调又市置别。', 'rejected', 4, 1);
insert into comments values(null, '卢刚', 'c.nyvrpvfe@mcrdsku.ly', '1973-02-13 23:31:06', '青更主种白究术如则事期门查天。应后为眼起前构位元作适备。说位值龙养报设办成科和研革但文着。其放节酸历个至容求面子动。参作克局总派平代铁构命斯金业。', 'rejected', 9, 2);
insert into comments values(null, '卢磊', 'u.tgox@btgixvjwn.ki', '1973-03-26 22:35:50', '管大三明切时八历花革里形色除层么养。中做重规须极比的主它往业部持。下林响切主产土传学打东几已自。关同时广己石以高住矿两正。', 'approved', 3, 3);
insert into comments values(null, '杜丽', 'y.coft@xtzhnlf.om', '1973-06-11 16:08:11', '志受毛会每空适治气积龙人务发但。示少因音米十中适质精快们民办民须。难却市队存社常京水听造适打做科。米名地事我器代可议治方越物开五型七。目西工你使拉克商少此的种节者。', 'approved', 4, 4);
insert into comments values(null, '宋磊', 'p.lpe@rixppv.gw', '1973-06-17 01:03:45', '他先选到约或七北斗展等料处件八离。象平阶知海管管马节住度结今区国。种比次育于至酸务调代构合明。其体装很土者是段气确证再据组适。它时省三单须由选两何光由热查内代按。', 'rejected', 3, 4);
insert into comments values(null, '陆强', 'k.wub@giwvucjrwc.sl', '1973-08-18 08:35:56', '江得者龙或毛精多七历只月统产。样以消自国日内严技积南斯解。性况着加京安提团五列式派步从二。叫感维第务深气而数据商全八率厂周。', 'rejected', 2, 2);
insert into comments values(null, '武霞', 'g.yrm@xdj.cm', '1973-10-19 17:20:32', '从由式争铁一年关历进争关积路龙件点。人至声技响很表南提红提真气。明片保各响极采也记个斗加你把知支大带。质受这接什争思位着构进口些想划专。', 'approved', 6, 4);
insert into comments values(null, '阎伟', 'h.sffqlfp@rujfmbqkt.tk', '1974-01-02 07:19:07', '是代传形场利常力众劳对接委间与口。指结们动众强本七再土他者制增矿农已。族一路据体表七今定工族选石达使照联。断两原次京子资根得空严商族程该提。', 'approved', 10, 6);
insert into comments values(null, '李娜', 's.ifpajosgl@poatves.vg', '1974-01-21 09:50:14', '他入属根住群边毛斗化由把育光能。号话况见交结响走道义天行眼万对改。研节过目资标社王海要两我况省。机北使名日标律风候设各如张。切西自太去根西无的连期张。', 'held', 5, 4);
insert into comments values(null, '雷艳', 'l.hdyzoqx@czkokgu.gi', '1974-02-20 20:39:59', '能点平局此马取容值太身技素候美速。月前中米行生化以将你料形南思边。是说更才快包原系本属各出。用那由场标科来导集道名十是王运。', 'rejected', 1, 6);
insert into comments values(null, '白芳', 'l.cipfy@txielol.ir', '1974-02-27 00:09:54', '但省适看门有基者却名完一。前件带命领阶离义共见往点。之种族器万造在产极克开料。头相正况称斗目被王江作厂战。斯叫事调流完查再百织反效接周领六运。', 'held', 2, 4);
insert into comments values(null, '朱芳', 'e.wfccidnnk@etifq.info', '1974-04-02 07:18:03', '最术感状建长整科七及整工学所技低参。民下铁农才上权基将同支立制处命战。员日除压院战党利周心素理书即手后所亲。线人什它人便得信石确始老数律九被员。', 'held', 7, 2);
insert into comments values(null, '罗伟', 'q.fsis@cgiboo.bj', '1974-05-03 10:20:42', '研区社世方政万酸张称时具九斯。群关半身等进也青叫图文被。理军写年任始查领万都务东石。', 'approved', 9, 2);
insert into comments values(null, '范洋', 'm.swbu@psxtxvff.jm', '1974-05-30 02:29:10', '层记斗队比制革六示展写决。认王划部际情天眼金小万青队级。由和比办产现界花种全制好长学其速历片。接外思术种光可支须型步温指。', 'rejected', 7, 3);
insert into comments values(null, '刘洋', 'm.rdejumhi@ffntqo.rw', '1974-06-12 18:14:13', '记把关料也以值美复手委和位五。不难历空取活引地成便收单族速满则。活都放青华通党把立青快单大易。参运东必厂任议般采位万速学。', 'trashed', 3, 1);
insert into comments values(null, '阎洋', 'v.mrhlb@mcggk.mobi', '1974-07-22 10:02:56', '求多外育就音运素头于工社也。由我术已声厂备列决海全酸利那更百示。军农重容治克原经规京那它属二。半声该共图书儿道最员过力复通她容团。', 'approved', 9, 3);
insert into comments values(null, '郑超', 'r.olva@eulruc.su', '1974-08-20 15:43:15', '年革老府算声属事光位共导格实群可立。性切感议间组么器通口离记内西着小。结适代代格体明七断效圆这团。具百号来放动地力有群飞与果先。', 'rejected', 9, 4);
insert into comments values(null, '高秀兰', 'k.ifadulu@vssknij.cy', '1974-09-21 01:15:24', '将规无按没必界国对争史济西内何。光真步起深角领决严本较其。是指作志带引九义步体精但目把。年见毛如打时亲因须话特果党据政那。间快同到从置观军发见常成心劳性。', 'rejected', 8, 1);
insert into comments values(null, '李娜', 'y.yvi@tkc.com', '1974-10-12 12:17:45', '起决更在导干参千前去与听多。么东样活石半小是青则省心清温动。则以米形可日调产节实才名约素质律非。史热车百化是极式平值集亲就效。华克达共石和验须音电加特说法体深。', 'rejected', 5, 6);
insert into comments values(null, '田伟', 'y.fqpx@djvkdqpyj.kh', '1974-12-19 12:02:39', '做国来流规走准走深候非石产车。统年专利如属美克民但没才保群交便资。头不条立多集研党么水百由规音直。革层南式文四适进列严大太门验意清。', 'rejected', 8, 3);
insert into comments values(null, '乔刚', 's.nigynfdi@vnu.sm', '1975-01-05 22:50:01', '程石律美音果几着解精压养断号历最。铁效照适标半其育就列系走老高快。例口专交它选长听会资研七加。九料办口方除九至位总几第始干以期件。格律期第导你放见区济电果习局看无。', 'approved', 9, 4);
insert into comments values(null, '曾丽', 'q.kjaggs@piumdhyeu.vg', '1975-06-20 10:10:08', '里者越色种便性流律此果强五没管上斯才。构因质回道民金严便提究府加合。正现林青争单定九则话出到影后资石。等节增毛几运复步广花界点般。', 'approved', 7, 2);
insert into comments values(null, '徐刚', 'l.vmxoru@nbuumwi.az', '1975-08-20 18:23:05', '按更者报军号满想见市办军线热格眼观东。消连北料什说常种三各委实表。委清行么的品线价业统严话者可治半。出步及备那许想质四称业收示。质复如七两对斗去产根革严。', 'trashed', 1, 2);
insert into comments values(null, '夏秀兰', 'a.fefi@xgkpx.ae', '1976-01-09 06:01:25', '须义离快五万立造法对求人包达布万调。过劳带明段速图也料合成表用先。政术已白品门军开干整同东美体。', 'trashed', 9, 4);
