insert into comments values(null, '魏娟', 'y.ndqqnser@dptjwp.tv', '1976-03-08 05:40:19', '劳要空格眼发统离更政决四。经间青许造才每历争线况史类。劳红今史史口称比原清革式象。按清王你中作专眼委油断长。低住改光信收至结元我最除往白本什研。', 'rejected', 4, 7);
insert into comments values(null, '任平', 't.bcvxhs@wwyv.gu', '1976-03-22 08:32:26', '广院后场白统证划细根标联王级参王增。国此却适到放半活展包等值说及。共始四片引位法采数包究小。动海新叫持海构备在细出量记心。', 'rejected', 7, 5);
insert into comments values(null, '贾静', 'q.ppdmm@oxojsgqdl.bv', '1976-06-03 18:49:29', '气影相部表包京运等此圆不带确持。但极事在时北样及面白省查受构展世时国。电土高边进特般系又上维使矿西果越下。导非我江经法两了期节识置直万它。', 'trashed', 4, 2);
