insert into comments values(null, '邵明', 'b.trqj@iaodptbjxr.sy', '1976-10-20 14:52:28', '体京决车治院低时住龙原认每许人。毛号八十明毛主术音时度入象力合主到清。当江置路值物天质来维结持代参那养。如器会价分体现为百市飞需现严要周。很见放头此标和些与干口者无林只展北。', 'rejected', 5, 6);
insert into comments values(null, '侯敏', 'k.ohce@vrvjuv.ke', '1976-11-01 02:32:01', '机不构等团将却公反知目样七节之。图再半为级适构温多极质声下。主作立就么机多取写展什近农指总水与。同书时越南果越存片队选作在经。', 'trashed', 2, 2);
