insert into comments values(null, '朱勇', 'k.lobe@cmxccets.mq', '1979-10-14 20:12:22', '北民最价口口府说般需习候与着组。点题论克就会两期青识为就五强现等例者。团支间济百要转机调其标准但律被。一布办备构向县数几派二音地走千消所。质眼万严容代决很五价回步已及果。', 'held', 8, 3);
insert into comments values(null, '姜涛', 'y.xnmvxla@tbu.ge', '1979-12-04 11:54:27', '百手马群持心张认别接单率力眼处。了交民办百间温例形相公出已支。采切决合段温至七拉南化山线此法。土选而该定采实飞通走员保于济己。', 'rejected', 2, 4);
insert into comments values(null, '高洋', 'v.ylqpou@ttwm.no', '1980-03-17 04:48:21', '地都不或型识铁马合各特把边设们。劳层任龙常上观有拉易强共来内八。二感院向算山度响面都拉或格思亲。七增军必就器青书铁志老两联出资意。面传表我准起图表应交领林美入打。', 'approved', 5, 3);
insert into comments values(null, '贾秀英', 'f.swxxkqix@htqcbgxjr.ga', '1980-04-03 19:05:01', '儿法气持计方党调称角了全好备装海过。效统出厂么基色主政阶北感口口。况命共称来连空日矿或速毛江电广场那电。商引始色日的毛率志群论应意律部海之新。', 'approved', 2, 6);
insert into comments values(null, '尹静', 'j.nianlpizy@bwfsp.tf', '1980-04-04 14:31:58', '导放眼山火规王自传每务界以。路动清长常政后头队名取心总千。广前指研入况治红向长里战类。', 'rejected', 8, 4);
insert into comments values(null, '石勇', 'q.kokgeleg@iiu.zr', '1980-05-21 22:51:10', '收比往传实天治但办只族况石己调。思号通张称了放题式力去角共你机。向直图理织加毛金接制布当料。二发火相养金月值事一南容南深近才打。', 'trashed', 9, 3);
insert into comments values(null, '许静', 'g.odks@fidcdduoy.ht', '1980-06-03 01:05:37', '给白备元来别且存想九酸身拉公革。张近组铁经出阶育改东精等金即总想毛。证几历机转点完素它每导适作。据下消己置全物示提设她即段改。', 'held', 9, 3);
insert into comments values(null, '贾涛', 'j.zncaifesa@jwxbxdihiv.uy', '1980-06-05 03:35:32', '料改程去但低当层才验种议省无业。政了社从际等增使平会先规千日品交。非式权连样反属与太合次断使况经分也精。干次命影达如极增号整点边进引条今段。', 'rejected', 8, 4);
insert into comments values(null, '白磊', 'q.sxbxd@qhzvyi.ma', '1980-07-19 12:32:11', '共华如由离当战意领重制严属理难。克海决自养看回来月线往调保活心器传。于理处约何以团且红铁信走照立。布热具空林由派周命水院际后复百十。为容物且号车常四近证时七取团少。', 'approved', 2, 6);
insert into comments values(null, '何涛', 'a.hib@dobnvz.nf', '1980-08-16 03:19:50', '适走改天给必形声受再装律无干些族。音她于取青决到毛律代中门求气。新济指数该值加身快象到只对教写。机标半历感写资记群才文上果保机。', 'approved', 4, 5);
insert into comments values(null, '傅明', 'd.zoenvfg@gibvutde.ms', '1980-09-07 20:39:39', '六万给去织改片产验反一门争书品除。属海又干委属路前选强历知积百几千因准。者报资二管它多低般十话步。身常易二交过家地们九地原正队导。', 'rejected', 9, 3);
insert into comments values(null, '赵军', 't.oxjxb@wsdpkts.ne', '1980-09-23 15:24:12', '知美听米打组中志便前活较会。行如电她百作无速增识一对正达命儿或。养从将系可声进增路切定明。', 'held', 2, 4);
insert into comments values(null, '龚丽', 'v.rrkmoumw@iiwsopmlk.gl', '1980-10-29 03:21:11', '品集革队眼场度青书信调生样包型包学据。式想七反必消斯们无用传业条从。要解至国国你历制从安以回节商克。真回周新复段构始政区同任青。', 'held', 9, 3);
insert into comments values(null, '文秀兰', 's.uhbs@wodwee.ls', '1980-12-31 11:38:23', '国子技精别照它立争明它流多动里革能。布数处率期火量身选利按它求结素八看。五写年林要党新低体毛成对人又。积必保世还受给量家状表把。', 'rejected', 9, 6);
insert into comments values(null, '顾丽', 'd.fykvhvf@eiaioypa.hr', '1981-04-13 22:59:30', '从统劳市图间没大间步上确总历我集。那律划及完选车记二包军拉。道儿速华本农质约当前参金走导真。', 'approved', 7, 6);
insert into comments values(null, '潘娜', 'w.lsscl@wnut.bd', '1981-05-13 23:29:46', '设成支此识手必种阶法都龙化求和太。切手内没地七角准道位将须程相一此。金米般代世线极力存质报正天工七单气。世采经建离济运选划对江花龙实九力。形中精解行即技海具很听有。', 'held', 10, 2);
insert into comments values(null, '曹娟', 'r.bepxsbl@duwgx.in', '1981-05-25 19:32:25', '家海民老设图究团等式代示酸同见。如代养油适现设调区真料称。听表基易论书位干式革以备最算。何农相美动压省信议准展百格该。完最江以委备土义况身数听观收。', 'approved', 5, 4);
insert into comments values(null, '郭明', 'i.zdwwd@ztugufpsc.us', '1981-06-23 21:23:49', '如之精分被分火了都起团红名。它听才例题离题参代那已他动先。声转容最海本心况件世名从派张一商。', 'rejected', 9, 3);
insert into comments values(null, '丁丽', 'c.ofbpfdrc@ndqmvtpq.sd', '1981-08-17 06:57:32', '据百别业质新眼参温热定装已斗明况。切须万位圆给矿育发写手极们其究世。七正书传位消万金她局派感亲件门压。品安且产快存力色主精力月报必话代。', 'approved', 5, 1);
insert into comments values(null, '贺勇', 'h.lzkxelc@cvak.asia', '1981-10-03 14:24:07', '律但设车实比又平些片共经资历已常。美它儿看积较地存为么放包时导传领局。同社精流土高连合广下程料。条其日看也思相转带他道什称层局电。', 'approved', 6, 7);
insert into comments values(null, '卢杰', 'v.bxjgmel@mpmfxl.za', '1981-10-19 09:38:26', '族共离全再他化例意力但引产强红极。织克人收门京任任建条持放料两期因。管期候口府候政原合农然素立确年王平然。到给或类便世进机严科间原。局利很已始打经说意省多角。', 'rejected', 9, 4);
insert into comments values(null, '沈刚', 'g.ndbhxqlt@edgelsgcrf.gm', '1981-10-21 06:52:32', '周质况响因记片二流上放构结深资高据。点易共重天分满维路于眼再程政。将当到风那及花亲历那完除学林选半政段。', 'held', 7, 4);
insert into comments values(null, '邹刚', 'p.otdnkyctbc@btimvgc.cv', '1981-12-09 10:06:53', '而式美积儿于红在次革军布体新头边还历。公从种如重而半起易称七么米情。今飞共月极开间称证内难业。温说务广美斗命始得支表带象。米到便林管复决省识开几她公这或如规此。', 'approved', 7, 7);
insert into comments values(null, '蔡平', 'u.kidn@qktlfwvi.bg', '1982-02-18 01:54:56', '节效山相内参白小想数作儿往委。需斗被样属共想平油料米道界先段求。形再真四头体存装变先而备此论广道路。为七构根认反划象着问最年水热。', 'rejected', 7, 3);
insert into comments values(null, '程平', 'j.qnpt@kttd.ga', '1982-03-28 12:30:45', '她成族再二机这元派东很布技劳车。布并须又加化际文马土义展党公。任例务个复劳给现许己区产点工。即你八带便效年她声气些知消务率然经。', 'rejected', 2, 7);
insert into comments values(null, '丁丽', 'f.buoj@wpsd.bb', '1982-04-29 12:41:42', '每铁由际养此也子料成石周。比小步信道月子切经体称规有感动那你。学六类品导米究好感单议厂说。知需里的速装压精只带识便。件重水济太电认好华断格厂管。', 'trashed', 7, 7);
insert into comments values(null, '阎娟', 'w.pubmij@kfw.tw', '1982-06-20 23:55:57', '应通比识将还放明率质被细团正比。片运品存直色世王信命用技科分林。京构总先增专至矿间好则军信近。见却说日比类己布处低须片。感对飞决量些造阶着厂思程队度近全必。', 'rejected', 6, 6);
insert into comments values(null, '田洋', 'l.ijmefawspb@kzvrjolt.mp', '1982-07-12 19:14:59', '种天无长要保容儿八山华派造离战确专保。状小为又必除金电次际离来里认常导。政院认制研现身京步平正区具太界表基。', 'approved', 4, 6);
insert into comments values(null, '白静', 'g.nqghl@ixdyp.pm', '1982-08-06 09:15:11', '很目分真用力进开重山如工局严。连米土王完代深感动但打己还需格。取议得五易值斯分飞火进这候度西。管色问感正入周电起基极还劳出组直业。', 'held', 6, 2);
insert into comments values(null, '徐勇', 'y.bvpj@kpenwu.ch', '1982-08-06 18:56:44', '两改将要流打统设最命上决。品用局据做林容义道动做至很不信。展花五阶包斗难们值行四求军。支论几公主业金或人过价正往开员如。', 'approved', 7, 6);
insert into comments values(null, '胡娟', 'h.hrpucr@jhhvf.ca', '1982-08-13 08:01:50', '适革引原温一之却连养史无边调。半与近现积包太况放口志其选济。小没发精组见事证拉律着新备支件度知。', 'rejected', 4, 7);
insert into comments values(null, '姚丽', 't.ypmka@oxkinovxz.bw', '1982-10-15 18:43:50', '通观根从人文成难积物更度东。统加导影命图经就这带写关开利节示出。各统表正府现次人感现导同向写度第大面。', 'rejected', 1, 5);
insert into comments values(null, '任明', 'u.xilhd@jwfegrui.museum', '1982-11-15 11:16:52', '火同要特指从何热选期水断已集规重专。么想空发传格识派法始例风思一马压七好。海自术济有积龙这具始资采来至来回可。', 'approved', 8, 1);
insert into comments values(null, '谭丽', 'c.wmpyckeln@gerudq.lr', '1982-11-16 03:07:12', '石油门京度布所通极外片领场。农提头形政酸车断才命者动手电家北风。派府国龙任力局出类边带会本争。明问际业具空干提可新专圆公。', 'approved', 7, 5);
insert into comments values(null, '邱秀英', 'w.esuf@minfl.中国互联.网络', '1983-01-04 10:17:12', '三第部厂持确务候选心半论。真什改受真段级加特利接志才研。品治定以农法四集具温果己严已时。回十们断太学受将层争劳每山。', 'approved', 4, 7);
insert into comments values(null, '郑洋', 'k.rekb@wvitzor.sd', '1983-03-26 17:47:36', '组我段龙华标器飞形路领政几命矿离。持格青军色五压识支联然问发质人七。算权低不空常海力线再关看工物参场。得级效至联包更约量很当长细做。', 'rejected', 3, 2);
insert into comments values(null, '林敏', 'u.coc@oqsvpboh.ru', '1983-03-28 12:05:33', '长在大准取史响共入安最置红热二边。查千八没每三但更拉政广规。整几制时还角们类之改利传难。府变学切厂住只火量同起度务并间除。', 'rejected', 9, 6);
insert into comments values(null, '金丽', 'w.yyeqfpy@uenmurhov.gb', '1983-05-23 06:29:00', '就四文把照七老号者根先线家物则法。特化集速六质由土度议万特与较天石手。月天总指素总号林圆步没很马。强写府门线八对原许大都科般。设细更可式老自风较通论战活连教眼太。', 'trashed', 8, 5);
insert into comments values(null, '孔杰', 'h.yrkrfnvok@fkojthcl.ck', '1983-06-30 03:27:33', '山好产东关同路是社联还深美支。看角水置传机志史技权今飞上。教间非问动上与列华声着算世林北区没。', 'trashed', 6, 6);
insert into comments values(null, '杜强', 'o.egsxyhlhj@rjydmuk.tn', '1983-08-15 03:33:12', '西府能及度严步管料张而千斗院便。太龙世放候酸族家究员龙员土当满存边。容后已西四况须上制化当矿文意常知。统府来记心平公任题飞改利常。', 'held', 7, 4);
insert into comments values(null, '彭磊', 'l.rnzsexfn@rjkc.iq', '1983-08-31 01:26:24', '步们公关厂解往圆科很持王除理。形资设市手为决质现严用国时例。军型前才经新元则条属问以么。片府完本他式证且质你快话数代。', 'held', 2, 4);
insert into comments values(null, '孔涛', 'u.fbja@romvafjs.ie', '1984-07-14 04:11:33', '题受除识能且但他一表较必着。其油列格看术部天路线和建手。出金技装具方强领写气求合山。', 'rejected', 3, 6);
insert into comments values(null, '龙军', 'r.uukbdmmk@bkgchy.tt', '1984-08-07 11:23:04', '万并科周派据积已情加问色选满还气条参。解响新管那就军反造发意音格。接我很已方它具联近型府治王。带育者和料克式满建发众县酸较引它务。放任位容你关见报划意共构但好名。', 'rejected', 5, 5);
insert into comments values(null, '任军', 'u.unthqqbrw@ssyxi.nz', '1984-08-17 03:25:02', '和历形九命去深式资引为议土劳。每员步算队化最话该着做王收军商。群断查算事米导参劳政儿说料。领水响教决多目书法局常相点度。', 'approved', 1, 2);
insert into comments values(null, '乔艳', 'd.keywju@qnit.dk', '1984-08-29 17:30:25', '增就快气队并并老海土可热值。五养走接研知连广了有济制改见马。八团院象那率走取油事今边品化件西。于收细直格当山八周路原家大。', 'approved', 5, 5);
insert into comments values(null, '吴磊', 's.buvcxy@fpuluiod.sm', '1984-08-30 13:22:27', '级而那复调必表主备到老解命据查今天。段满厂林外斯决主研什至广持更。引生装当气科布界按八组则感养。红计多局指就能运专复比产业美连用书。马声划统情相立万着业在且在技。', 'trashed', 2, 5);
insert into comments values(null, '郭明', 'g.iakzi@pvlirqkixq.as', '1984-09-07 11:34:32', '以对她京生红石组大候研连算通。大系拉候叫之却头道被分加分厂史切。今是花发安老日红由的此教风她音口都。年查满共价党严马证青叫点研。', 'approved', 7, 3);
insert into comments values(null, '钱艳', 'k.israhgrmj@hccqoich.tn', '1984-10-26 23:32:49', '场属证队称科太利细美道作四二花名整。切今联值质张族情受改斗百北来今四往。于劳风你白向命八切可实组现热些十则被。因适一数电的经电条路十酸正头标大意。料只事可造部龙交听代须装米层只书里。', 'approved', 2, 3);
insert into comments values(null, '范娜', 'd.ykbtvtuzky@njz.tp', '1984-11-26 11:02:36', '石制料她去江水给九称称在复。育议规广千门系上山系们济识米收金原用。九关用严成军全团斗往问往济须响题。', 'approved', 6, 3);
insert into comments values(null, '乔芳', 'h.zpqditadx@jrlhonru.cd', '1984-11-27 22:55:43', '市制连速存直展程使省建各各。所大不长政大求接道证接长。是它时专道天问派在常没拉参一等音称法。或次开会制级需条革单料发再。少级王农代及观族现自本打示入。', 'rejected', 8, 2);
insert into comments values(null, '易芳', 'q.tqlll@ftnwxbchw.bv', '1984-12-28 10:44:07', '代话给自物音它别据于队后八回直况起。圆指全表装龙易听合说说眼布具属教带厂。果养引政往作没例入基论置史切取。院置和争团现全新专里个论。', 'approved', 8, 5);
insert into comments values(null, '萧强', 'c.kemqn@gckrk.ua', '1985-01-01 22:34:14', '前使了型维值门不况机自何参法先证不京。太此说号话只名速认权历光按。法图断马儿部取老前回长是时叫。习么该生何变四局知给自根。', 'trashed', 4, 5);
insert into comments values(null, '崔敏', 'o.srgyi@notkjgavyf.by', '1985-02-17 08:24:06', '省元写装级引石地太四更任家专。系消始来信建存毛回论农该省此没。派布心通先响办需达些算感那。度角子论明相局表持他东象见它听年。', 'held', 5, 1);
insert into comments values(null, '彭敏', 't.bdbdk@nkuin.kh', '1985-03-31 18:08:30', '始去你得这例存即口容些而管党意权则。越主许作族题教一没约设来回经。他了入回说改之济话被共每。', 'approved', 3, 2);
insert into comments values(null, '江磊', 'y.khhk@aanmbekm.hn', '1985-04-24 18:59:58', '二问素建门程九内常较处办常程族自命她。转线记算片导根没想国积越。统专资记下太前色并派对更民划话级。儿表明出何文听圆更劳下海子已解起斗。证厂与开京教压层感战不或决果细。', 'rejected', 3, 2);
insert into comments values(null, '贺霞', 's.siqz@fngy.mn', '1985-08-04 06:45:49', '方非知军第标老用府劳下布如定林自。委自组果结层情党专议适对省得一制六且。信求别半么各原气克住走亲支。型存种重用速里候管这利结。', 'trashed', 1, 4);
insert into comments values(null, '许芳', 'p.jdtdtmd@qknbe.ev', '1985-09-06 10:02:10', '准实着知指处京万断斯主许出以技花华积。她精员照如员收参理派报特。究六资转千清直安联而面更。而整再上成转却调件置管些国度们单克以。任变响想为向龙查正命包方知干片量信。', 'rejected', 3, 5);
insert into comments values(null, '余涛', 't.dfoijshbf@kotqlowl.jo', '1985-10-10 01:25:15', '又书更越验义酸直重学世她志化究期。回酸直容公标素马论性局满平素成火南通。它及马边别住时表象证角于时而理结做。求院动计采计土相务土分气它亲精起儿。她间快几快红民听须深除过速眼等了称。', 'approved', 9, 6);
insert into comments values(null, '邱平', 'u.xnwi@mgkute.sl', '1985-11-06 06:51:08', '持验你给易亲书片走划别表层济受论查。资设有小象真则路物识给据青层值性。象新维属办志写半圆称区上。建派处土最六养明求儿报义面作存。', 'held', 8, 2);
insert into comments values(null, '叶杰', 'c.krupjm@nidyhin.中国互联.网络', '1985-11-27 18:00:38', '提月在路点则人她加是热切历称示则。圆候造持准管清受布亲都民众已条。况意关导议之律少万须时保平十素。得备步低油选重却事交后相约个万外存命。六世也增利产除路已才是般特思议身。', 'trashed', 3, 7);
insert into comments values(null, '梁娟', 'g.areqv@rktvkbu.es', '1986-01-11 00:59:35', '非包验最声国物没即他低手质着治养此。中比总精技受水育系周团三。低接于效长家外等治手及收观商。料种集那老容王民都志集大际经着断专。', 'rejected', 10, 3);
insert into comments values(null, '余霞', 'o.cottr@fyjk.ly', '1986-01-13 02:52:51', '照除造引可物对生称其明队称信果低。命向期志是群布由保县何压。带社接起非过领心利较起可。年加查解家然主线没知物空都根即相步。交用备土机两相石关青处世始程。', 'trashed', 1, 2);
insert into comments values(null, '汪军', 'x.dftpltwq@wkgl.cc', '1986-03-16 08:12:25', '以你至难只思阶上战改者住并论切般道两。斯要县准过何号住切有清事住。会习时几说里示叫格受团较选过决。', 'rejected', 8, 6);
insert into comments values(null, '孙桂英', 'j.tekn@uqnghqp.pe', '1986-05-09 10:37:53', '军产省声指你前部复红身根技飞主里海。今可活劳马究或公米于形需。资得标报历时段子县过克对长重。分度林收科义目区起完选包持。片引生值种种队定史较常斗论别。', 'approved', 2, 4);
insert into comments values(null, '程超', 'd.ppqpuaqurd@yaaipupv.gy', '1986-05-11 23:12:03', '参学强大战备叫感正明较外比。还世切周他段影验办验今族龙产个。部东务期科住传现各计点音米高。时众气器看时线之派动律名。器便复金八放题广观产打消约算最线带流。', 'rejected', 3, 3);
insert into comments values(null, '邓明', 'h.iybhoh@qnkxmj.ua', '1986-07-04 23:10:03', '果段特七期果以及象间规求话。于得从格养过形农想场子级体。往社气才间子需量提天信业角品书头。般该马儿查确入三达件这百收没候角回意。些委车些县红济作质斗领近。', 'rejected', 2, 4);
insert into comments values(null, '胡芳', 'y.dhbvc@lnvduy.jo', '1986-07-31 21:55:58', '打人集角种领花律于验验格山全法对。在建断族完月细其油花法利周思验。并北计只写手南示月五统此此收习界于。价知住学面证全己增但火将给林我。', 'rejected', 2, 2);
insert into comments values(null, '冯霞', 'a.dpyknphe@quinbinl.kg', '1986-08-02 19:21:37', '可响机者手好种下何国风土向社日列步。许相阶节见关二治无书提它。及实你明百能法于引而生局何规开具容。', 'trashed', 4, 2);
insert into comments values(null, '黄洋', 'r.nqyjm@tesojxbn.us', '1986-08-20 11:07:36', '才京平力省政主世走程我音种情区只关安。包要第力车我个交口儿或反给。以除验查展自八准作该知运不意接去电。产保山半七山交整交铁火持林同本满重。', 'trashed', 8, 6);
insert into comments values(null, '杜军', 'y.qzzg@xmbfwj.cx', '1986-08-30 03:09:01', '么再单有上写争产观些金增。素为运过电何后农相飞连么青立取完。象好政边听六完自京持天适海院世叫。看率更影际世员五术常报毛共号当。', 'approved', 2, 6);
insert into comments values(null, '黄军', 'b.vqufxfpfu@ssg.sr', '1986-09-08 17:54:51', '些特包产织团必地学五头正。你级理转当极书文每手然志干产电收。果被大带放劳信什总并再压正。', 'rejected', 6, 6);
insert into comments values(null, '熊军', 't.rsi@bmnybm.mc', '1986-09-13 05:16:41', '最程强都各意济米会装方保你。根持三号可候叫育北阶车放把亲该。但气断己决热采生由速分活证海。毛得广活长权划流方号性史了安。', 'approved', 9, 7);
insert into comments values(null, '胡芳', 'w.rtriw@diffypmh.sr', '1986-10-11 19:41:37', '先代选义确动发根别发少究战他面。点除方所六路县回称器运况周照知器了。本该清究些型长取点确干持儿命立。义再广流其新平千经和力声劳导便。', 'rejected', 7, 5);
insert into comments values(null, '彭杰', 'z.mojpgd@foovuo.museum', '1986-10-23 10:59:50', '社不例实家确记导间最义强门。王边这四明事低众作相长走素学级。设石记历标任达立出则须常加速。将明联习料从而调劳时正候周历。些地就总求日及养安都线边历百。', 'approved', 3, 7);
insert into comments values(null, '任静', 'y.gnqko@mnfnsir.is', '1987-01-24 06:57:18', '相代所为图集规几选科点种维干住她。商个现际正加花青走路活常群。实油形千表律指现精资角半数区权反。义全务参多角才强片组现民当们九识。', 'rejected', 1, 5);
insert into comments values(null, '黄伟', 's.zufksfvo@twqvfkjhpw.gm', '1987-02-15 20:17:43', '第划及况克么九因段飞除百。特向都素广完下济称七断元次边易得。少局进论维少社两老在段观数求素。线白立车认面率革立子学每光南也。', 'trashed', 3, 1);
insert into comments values(null, '杜杰', 'u.qlg@tjb.do', '1987-05-11 16:55:32', '电越先压从报身参主省准性西。取会给记联准五构除快干将指它。业后其义把本想被格支别己结。却选响型级林次命无京很七力华音色。', 'approved', 5, 5);
insert into comments values(null, '曾杰', 'l.vhhscd@vgavp.sy', '1987-05-19 15:20:12', '两了她近向属克安前者都整白条。办文边主酸成关克着全交何。开事合速来文行多亲山边按。会调变步象习质称王布快油个工。', 'approved', 10, 7);
insert into comments values(null, '孔超', 'h.sdojulmx@ktjksmb.ni', '1987-08-25 17:30:00', '级心面图子为价的住二全都实积规如无。清其而意华接认增向海热而律品专更。完物花商即根山方严第经难。多分南力算上儿酸并内音史需新类。', 'rejected', 8, 5);
insert into comments values(null, '陆磊', 'b.mvypj@xbti.tk', '1987-09-24 04:10:23', '意主学记接直根严红处回取手断际路单。众们完马查活公民持价严志叫段。集者少用由计已保度压离再其斯行。外成或带同里来合运听决身立由上。', 'approved', 3, 4);
insert into comments values(null, '黄娟', 'k.sxxh@isqa.jp', '1987-10-21 07:04:12', '如存力红度美化表去进证去真记据状。采物点铁于写京平张局调院商专红华。正气员群为值空强由好对大率才她物是。划想年代族次线数例山员国应马想着。', 'rejected', 10, 6);
insert into comments values(null, '姜秀兰', 't.kfa@cnhxzdvm.kg', '1987-12-09 02:02:22', '低什价成关原权必矿型厂把实见该样华从。你采要才适音军江组义能三交家志接。来太划实儿广多究究分细质干几被民。即备走容决系口电维议再类快十确。着联保全证斯农号与格是清己。', 'rejected', 3, 2);
insert into comments values(null, '王艳', 'i.cqwtoubre@nfieq.kp', '1988-02-11 11:35:55', '正很处建除得高在记性便给自过。流它律观一或带积便连党满加音活住话原。命切开书基价场公技称东运角化。识应行成再住须计题界龙放油些件。', 'trashed', 8, 3);
insert into comments values(null, '龚静', 'f.clzp@ublfudi.do', '1988-02-22 14:49:17', '根表们响海争太达理度事质题据。果天想还北和但林合则教开备结所思。青转机门结近四细江动斗离装圆。大机却今技六作式路次世北据对使化边。', 'approved', 5, 4);
insert into comments values(null, '金桂英', 'p.wrsib@penvkwmahx.name', '1988-04-04 21:38:32', '西按近两太对义应它各米图存史史看。属话问间文以由工花而层华研。称具验用至石历己问况又真器特积阶张着。', 'approved', 3, 6);
insert into comments values(null, '任艳', 't.wsbvwofr@xmuhfdesf.org.cn', '1988-04-06 23:37:31', '西战式话难教政何育说回公。问问但意验全年龙先多红品存度次群管际。利更直适来山正正转日矿节劳消。九事较群海指分她象加何事织装矿农。', 'rejected', 3, 3);
insert into comments values(null, '沈军', 'k.euqb@ucltaixk.dz', '1988-04-07 10:03:14', '道收关求步心进动标候白将。张今线门取或由电农则层当因越铁七。业几利及打织和般音历包度门场下单位下。应拉速气改去放也边亲备与四命。二花属拉写众中名放水及这动。', 'trashed', 5, 4);
insert into comments values(null, '董霞', 'x.hpdcdd@rqfris.travel', '1988-04-29 04:31:45', '增世放图志年立象由龙干在。广重则以却细周出至军本确。万开持群置料教没明以导明完她来律。半全共空和一变半劳生思价名。', 'approved', 4, 5);
insert into comments values(null, '于艳', 'y.crnoi@nyhgpuf.kn', '1988-05-08 08:44:59', '连并这社风型子务被么最利极厂。段来由长此识出所务率运者那文家飞引。也常斯矿问先状你价来分军克步具。多要空量片儿置族万争影看发定阶七集写。需者见专写史先决写声极院历化意斯但采。', 'held', 10, 4);
insert into comments values(null, '何明', 'n.twgnii@srkgk.aero', '1988-05-14 15:48:44', '准例存民海例集新人要生法同便。几民命任各间后打而团科行意特业低在。题求关率形南质石还代养集做与。同素量划情划由风声消二表几育万。', 'rejected', 3, 5);
insert into comments values(null, '谭杰', 'h.wsro@ljj.az', '1988-07-12 04:12:04', '定号真素选记则家律公取本今复族五织该。对意观结高况常外将圆入米现又道提对使。打结当没党内外去相领要文因线直。铁质需单求头商还门于地龙极面特。', 'approved', 3, 1);
insert into comments values(null, '孙霞', 'x.yayyqhngw@potkbrqk.hu', '1988-07-27 08:41:21', '火题许府放九变完方民理究音型白区。进际家说适所红越眼前是家。看照四性准线么王但界议所场制律。酸专建议思节什值什是权位写。', 'held', 9, 3);
insert into comments values(null, '徐秀兰', 'k.bvsemlt@ubhunu.gh', '1988-08-16 06:24:13', '确农厂实和规格四信用看北争政。过又数共车真将只省三决部积有发特则。理般农活华那提造这气素先本。原属确下至便文行气效流眼派相叫圆东。日知意他头除包确海具以叫也存市育海。', 'held', 3, 2);
insert into comments values(null, '钱涛', 'f.eej@enmd.gi', '1988-12-30 00:12:43', '状列管价方者由阶史太取义安例多许。求个办他三斯律思两处院何场权他外亲。料积太压须色物前地连养造。中太方叫提认改查度斗线众须了值走组。', 'trashed', 4, 2);
insert into comments values(null, '萧涛', 'j.efpw@bdpmldmfuy.br', '1989-01-08 09:36:30', '极件记者要非电同切养识西科响。断每步声流平反况个白角片机。界流决京有们长无被界米价放交易军从支。建县华受候道道术史整手具见。', 'rejected', 6, 3);
insert into comments values(null, '孙敏', 'm.ksvozcl@mciboqhl.th', '1989-02-19 00:47:38', '世内军进才小据身细始还科团长亲件。按只道阶战确话度准青示且民温证。在美转及立用山级写题调而族社先那。先建土意明切半手月价维建龙。音应位花明府得一重资万全图各。', 'approved', 5, 5);
insert into comments values(null, '卢丽', 'k.ocwsieu@wguev.sd', '1989-05-06 15:38:58', '色加所义育世实满花清果更件究。青常定生级九选金术七速理小史。战队事治过质放往住表发自量器越口育。要民利照不很风金积越己同许按。使她无意住开严展她亲持反化现。', 'held', 3, 2);
insert into comments values(null, '史超', 'g.qdckeq@gtgqmmfnrt.jo', '1989-06-25 17:11:04', '太亲厂边运相己众要七机最门习前提六算。装华任长省效响里非却就华且用矿象车。局果现争革需况由集人里且务米素更。则研把议平价收老观志业政铁么加。眼示金近工很见表出土反结周消根。', 'rejected', 5, 4);
insert into comments values(null, '邓芳', 'g.mfkf@nsykvrus.bw', '1989-09-06 22:14:10', '设上又查见严而线共查此更备工或美确路。求果别院会过整命不强权气造可动加思。口容严自证头自指要干则家作如属。而器习验为命养严用标图们团。', 'trashed', 1, 6);
insert into comments values(null, '薛静', 'o.mndcjyziou@xtdpynlynq.ls', '1989-10-03 00:52:17', '她重三真与想最道非接现识还都或己。期派大习上力立情着去分矿。义同些真受常江去路听他达少土。十内用并动些气中办验所府温。', 'trashed', 4, 7);
insert into comments values(null, '崔敏', 'u.bcgbtswi@vmobjf.se', '1989-10-03 16:00:40', '他要更要指层入间称实五知带直没之运。那入个证安新王单响八直已海统。部命难要族可明率知离国置变器表正。', 'rejected', 5, 7);
insert into comments values(null, '姚刚', 'w.dmdk@crlmv.pw', '1989-10-14 10:38:12', '前算四重利十同研此电别型划天。受构规效八认手步清法中名到干。压必信整转因大江思她律面海算先好专质。容队较展论劳队步们立面知。', 'held', 4, 3);
insert into comments values(null, '姚强', 'l.pyymekumy@ypzfxt.ai', '1989-12-26 08:46:11', '平展统团保国平知及毛内门议界记近。且此你电开队号府厂她位般山转青。属斯圆带土立些万起低美史状心养。展专划革件界生干例目族劳从非造重。', 'approved', 6, 5);
insert into comments values(null, '陈娟', 'k.fycnmi@ssodiqyeo.ly', '1990-01-01 22:47:38', '而又华资正会必半问图影价斯调期展价。按江美律高又听文内新如根正属照存气。什中认设子院克本转构新领场和。原每之受在需第出场业于化太么到因。', 'approved', 5, 7);
insert into comments values(null, '曹娟', 't.eqiqp@mpjo.org', '1990-01-04 09:26:08', '生部外格单群决后看写队议现才平明。火观关知示共集自也红基这不品意儿代。战料方用三次教受院员温情。', 'rejected', 9, 7);
insert into comments values(null, '雷涛', 'x.mkoevr@esrd.gb', '1990-01-19 08:26:24', '已建圆新后建八器队入高保式打外心。质加置越存度料边派完建花月感。酸三部林化造比发我意更进群证头保提。我广认感量王进量置之动战比号。', 'rejected', 4, 2);
insert into comments values(null, '徐平', 'm.suer@xsqy.ca', '1990-01-27 12:09:19', '出按议当它把结照光平物据须。那报期会名但府听争长命习律权选。天名保直金记这所义程单问天角北育论作。亲据海根克变示议展更知易。', 'rejected', 5, 7);
insert into comments values(null, '康超', 'q.oqhqstwz@nbsp.za', '1990-02-24 03:01:09', '更步集运拉火连门花定提革法。米立处两无说要作米先况这们单世位步人。因革于被克断求己点改真用次济能。头理进片从酸把完几或都此工力。', 'approved', 3, 5);
insert into comments values(null, '曾磊', 't.gydvtjsn@ongzyofu.gov.cn', '1990-05-29 09:11:09', '国识何采候出学改完管况断织机就民。省十今近形识据织百万至半也验织级。开有记海单点克期第严铁广列。段什学小电置书那花流被真太给利有。', 'held', 2, 3);
insert into comments values(null, '汪静', 'd.uayqyuucv@dtqjw.hk', '1990-07-14 22:03:43', '名发委物水参院同具劳它较你包。看斯研为群如之整包得技二导不四式。总林自难活联子列发教果立象。起共华教意张院众门教流展何着争算越。力少同说年保质极老儿例车除连识得水。', 'held', 9, 4);
insert into comments values(null, '吕勇', 'c.uhjx@rugbjy.cc', '1990-07-27 07:25:20', '马张连果照起多立只直天共周原北了给且。油线联号战在情引事路本是后过所往性。报这或名人无住带一见转于热再。', 'approved', 6, 7);
insert into comments values(null, '于军', 'i.vxmovyqg@ddjfkxckqv.coop', '1990-08-30 03:35:34', '成快中划近厂手次比西适技打油关片。根民立当拉务世验住约同议七资。关必复定决过知战样管系车验改须该工。是象至化里价律观道王打政家斯太。品府由数保必的们教记大信。', 'approved', 5, 4);
insert into comments values(null, '谢敏', 'h.deywj@sosfnlhu.ke', '1990-10-20 08:58:00', '争学保设入别话数老委满集整很。量量之信力下最米到人除认。列只九电点流边眼道存备开至越后号。', 'held', 5, 5);
insert into comments values(null, '常明', 'q.rkoohojc@xhyk.hk', '1990-11-02 03:03:18', '听已历化明因从该资置作指然。立反机常车所类空重间比些候走属合。场然主性权题用定领四持走样。斯此须动点山表争己等加这府广里七结己。', 'approved', 6, 6);
insert into comments values(null, '汤磊', 'o.usxhhksbp@cmvhocrdbh.se', '1990-11-22 09:37:56', '点般相值位完热深不团便线进切。还么因开得北话直同南社更照候质。两身据准表构写历说战上众里研。度按平细何形多县子分将每农起例须。', 'trashed', 6, 5);
insert into comments values(null, '赖超', 'v.etc@jxigdys.gy', '1990-12-28 22:55:28', '验机京打开须省系十积性术两心。四现土在个有改至声动什后儿表日问物。商社响听证关些因解装住义号作观界。精消给派委名查体条基接府。体地八眼群严大理工要商往。', 'rejected', 5, 1);
insert into comments values(null, '锺勇', 'y.lyju@qwbjut.et', '1991-01-07 11:24:55', '造话太命必又上开事算价快。之家每联意或备务象被主克回快性上。眼值子育广包事决千部值划术六能何群。', 'approved', 3, 5);
insert into comments values(null, '冯敏', 'e.nyty@ziyvjs.ba', '1991-01-13 12:52:06', '规专电增究全少研求八却适且行经气六。拉米说油明百外华经该造越发。管热样八技生意往例其织约其构青。', 'held', 5, 6);
insert into comments values(null, '卢娜', 'b.wdhlkjt@yeyv.mg', '1991-01-18 23:02:44', '变压现林称据装口量商按斯按千。马除列受速料切对水低受间无。金自打线层科义候级光眼具。科意性压路变厂被机理山六制清商认今。', 'approved', 9, 6);
insert into comments values(null, '邱超', 'g.pceaxhbdq@xphhjpwikr.tm', '1991-03-11 02:09:40', '群老变平则政又才百料而然都平何。验革断内这增技强该对所个族众。方格说族家即越强派八样素少生来设。构满克别至身己目管空权等究海件世色。', 'trashed', 9, 1);
insert into comments values(null, '姚芳', 'x.ilmpleoti@nsrg.tk', '1991-03-21 06:03:23', '权非根产个江安果精根教它子油老问铁。海周温变动斯以称水业效叫。一算以用期相非议片研两且置与再部。', 'held', 10, 1);
insert into comments values(null, '蔡娜', 's.oudwffrncl@dcihxhxsug.ki', '1991-04-30 21:24:10', '于指酸不难改运音金查收标结离适。于况较音重走认基西身利今。信东法又还转存商等示什片过。', 'approved', 7, 2);
insert into comments values(null, '陈静', 'q.qwcoprnfsw@qbhuyjgdi.be', '1991-07-02 20:04:49', '论性他长把成利共如性社严。人转设始资而战说家级青文亲头。元分着文太儿高领表能车何队。', 'rejected', 8, 5);
insert into comments values(null, '顾刚', 'x.yodnyb@ygkjyynuh.mh', '1991-07-08 01:40:40', '党因其素达意影养回听矿向外问们本术。式它各近周置自些高六技山工。线形文叫层手院平量备之声她千际且集。收构以各事系型导县提明员。没员五人百造有制任众老住什统红。', 'approved', 7, 6);
insert into comments values(null, '姚芳', 'k.qzmxquy@lcoz.kz', '1991-09-11 13:04:11', '民参土大等除线却油边做严划每。再所被时无住花已务图示边次七转。边织天干放约议指据直般才。又北酸济除理候地压土效出受着活程。是文只起响气此文则层性程。', 'trashed', 9, 1);
insert into comments values(null, '何超', 'b.ihca@yeppvoc.cr', '1991-10-01 09:01:03', '没部你场土关周新万手美确况。比市叫对人却场价委观几则议应。根家越点看除温识你命引置她历书区。亲白金教五参力受们个飞门转根心听影。', 'trashed', 1, 1);
insert into comments values(null, '叶超', 'l.mivzxtoso@pcskrtmwi.com', '1991-10-17 00:25:44', '学科证器格近龙八青基成住天向再资很。布质干同先题几中写多精真局林领。成传者易般主统格节起方龙决少就压日。展共问图部劳活己压亲引主来写来。', 'rejected', 5, 6);
insert into comments values(null, '万明', 'm.blrzjkfin@qxevmcu.中国', '1992-01-20 01:09:00', '知件打京常要名子电张亲加按。准报命转装有准议备记单道何指。关团那领九际单必明强高类论地二数。提名备由阶广出求除变再证越。', 'trashed', 10, 4);
insert into comments values(null, '江霞', 'l.hxgem@dnqb.gb', '1992-02-19 14:00:56', '式决任价现小转政八想之积量引没十。满资动东中确基点法清但外机后六南达达。放应世中出美设写物青毛支运线东。', 'rejected', 7, 2);
insert into comments values(null, '任秀兰', 'j.gionjdqejy@uvmtmowww.tt', '1992-02-21 21:51:46', '员极拉比产主历加管整统联。是争意力运效有段决再快人题成后很。具党月手况低风切两计细物及所构人率。', 'rejected', 9, 3);
insert into comments values(null, '马敏', 'o.ffqgqemok@ooifq.va', '1992-03-05 16:54:19', '照省就县听身压素东资直引于。林儿十律百么说第快青难状论布北。真统回党器南精程满统采广平至到反素。空车圆族达已对毛内本连需通实。', 'rejected', 4, 2);
insert into comments values(null, '黎娟', 'c.ynxcuj@qxky.bg', '1992-04-06 05:31:58', '政及里值再分义价确中白响给。属装道清五族该史反件者明府马。体感例题极革就重构中儿路般日基单。', 'rejected', 4, 4);
insert into comments values(null, '潘丽', 'w.ypxhwl@cbyymt.fk', '1992-05-31 05:38:49', '同但料层美通实当通色他争种五支。飞近品指时高无话长才家满际。圆员县等色声织计按细新标分据习事。至看劳省支包众当照情技车战已切易。', 'rejected', 7, 3);
insert into comments values(null, '郭涛', 'd.eaqvhtd@vboocdm.com.cn', '1992-06-16 12:51:32', '山机交术出成的水作下变选中天不。心江按复北长今反好在头系。南不包识电被花再维四达地点口直志。积派按手斗别证这书员因处干济公引值。', 'approved', 3, 3);
insert into comments values(null, '袁霞', 'x.cvwfrqi@hpqzk.cc', '1992-06-22 13:08:46', '美规价程实表单除过体什增少经。决书利结通照料流当信小之际毛问。物治团个支家目规手又据种有办量。头和样处志低向电能队于加火现。', 'rejected', 9, 3);
insert into comments values(null, '郑刚', 't.wqkubz@mopctdmlbj.nl', '1992-06-30 22:15:19', '接高被达住利处除只京向可置能平南且。外区求火清小各发家音把价文号。置或引品心府较时约选江数民员。', 'trashed', 5, 1);
insert into comments values(null, '方秀兰', 's.dkqkoyn@lburmusb.br', '1992-07-13 09:48:18', '质级了利多需时求采管计住会红山想着变。代则接候三酸社过片里带所和什级育。式队属备变议通高候力应支计太所酸建。专价水道收正产因教养消关支。', 'trashed', 5, 3);
insert into comments values(null, '夏秀兰', 'w.xdfcqbho@seuv.pk', '1992-10-25 07:58:07', '于家子果他可全百建关料京集内。农造员给江干知去存学展量查感济音。三老水术发还真儿学三务身没报力林实美。儿大江步布确无见活公治率属二。', 'approved', 9, 6);
insert into comments values(null, '傅桂英', 'h.wqkcc@sdgmnvrz.cu', '1992-11-06 05:23:31', '必保林听十少过流例身之市海所号习。音场角素办此率听商处论色难示专易段。元值几斗向世将三非王色高不农重。已在志许常角派气级里们原状许元四可。', 'rejected', 6, 3);
insert into comments values(null, '萧秀兰', 'c.tsfjeuypyp@rcs.to', '1992-11-08 15:58:36', '革山儿使结许起系音离细去者路。明为习通快商者众专越低入被院见。更该空派使论流等满经七取办此称。', 'approved', 7, 5);
insert into comments values(null, '石明', 'm.gtxjtk@rwq.tz', '1992-12-12 17:01:42', '为调正回热叫清关进属容技量我。号段月度才断标办除却术在真五划。与交光两究白确起存情下把史响。', 'trashed', 3, 4);
insert into comments values(null, '谭丽', 'i.jllh@oxntj.iq', '1993-03-04 17:10:33', '参实想工它件图他期选存三容花带。布接如术往设力事点们向式半面。百于史起改些量位物世也论划矿消。结准国存其最低过示战选学。', 'held', 1, 6);
insert into comments values(null, '常杰', 'd.kcjsigm@qphb.si', '1993-03-21 00:17:50', '声直么参广究活空时小应政照。约较任非打严我八成类下史志度离从。西自制教时争性次部他由听音列传无叫。记行下照称位命人省划增八品求离研。', 'held', 9, 4);
insert into comments values(null, '汪杰', 'u.heplblnu@qonyicm.ke', '1993-04-10 10:02:35', '先来格千至切身县思展派文。象受工但类公何速金部同如度我政京。住话光海按油如低以界眼求真长。', 'approved', 3, 6);
insert into comments values(null, '锺娟', 'o.pdsoox@xbjv.co', '1993-04-11 16:27:48', '好处同处只经前经易五金速区动。事革给理往军现存信动铁重任书。院适示数明保素光如连际治压格八命。', 'rejected', 4, 6);
insert into comments values(null, '侯丽', 'i.yfvv@dmbhmnwap.bv', '1993-05-10 20:54:17', '总传体基工便热角别这而酸现流维。是与见结全电想矿和小毛化热深。来果由想民样约领自或已法保些增。候统酸马达期导真深家见决采常准再并。', 'rejected', 6, 7);
insert into comments values(null, '何超', 'i.xlz@tkohv.travel', '1993-06-16 06:35:28', '气人酸收布制京解史象因红。研流金问安必党酸火要毛制参学空。风美也后习群十公起半连术们北。它精天局准规但里习专用西科素理技工。', 'approved', 9, 3);
insert into comments values(null, '蒋静', 'c.xhijwct@hfqentegr.gi', '1993-06-27 23:57:37', '对商需治目府月拉和外便达我经却。质具定维口术数拉总打图九方元做。等参交农美物土始平事色商得。矿党系从十前阶石该人造白更那。', 'approved', 9, 6);
insert into comments values(null, '侯强', 'k.xofesd@ncqskwatl.dk', '1993-07-31 03:53:16', '治确话作去流该话商影声响压从知。子王少此例非变有名界专很技计这京八。军点例面约建许品严活经个号军。作直很支立又决至素产重京而。', 'rejected', 5, 5);
insert into comments values(null, '程强', 'b.ciwqwp@ptm.mg', '1993-08-04 11:31:59', '军属至候采身思见民许立步能济社斗。究道放眼六把公记须京支写知称。还速别期金维况其市样年见工比物口。位定联果安细三断受往存如己指放更称。', 'approved', 7, 5);
insert into comments values(null, '石秀英', 'n.egiklr@vtsfqf.bf', '1993-10-24 12:42:45', '料院性快放对六式容路农拉备清直。住花里传你争极复不西代代压。非难命反由飞做次县定八组最打结应质说。华被至区今必直始我增为红色决。理什同因实类油八组石五所高号问支军。', 'rejected', 3, 6);
insert into comments values(null, '马军', 'l.ppuuh@qwqk.st', '1993-12-21 15:41:45', '离法九示度角且当象被复识革流王。但公深性比提来又养千便你流方值题。务清改但相说原劳见资而行场社。却议始还集新维没属极热社展里领。', 'held', 2, 6);
insert into comments values(null, '沈艳', 'y.fqmmy@ejmtiwsnu.do', '1994-03-29 00:42:57', '料的重期满层采办达林布强同每。小样准号如定结开机把门议热。求认点传第带装安之看日转标人手称专。线且力构度斗后置身已基万连治和种同小。', 'approved', 10, 6);
insert into comments values(null, '高伟', 'b.mhtbucb@vjsvuo.md', '1994-04-07 20:28:36', '资具这什多全西马治什公就于为些。五火打广没作青美改合指类引难团他。制质性指作达色题同革本任系声置越按派。', 'trashed', 1, 1);
insert into comments values(null, '徐丽', 'd.btnawresh@hdyeebbx.ci', '1994-08-16 05:47:46', '格观些整史全京界表老山联。起体资公工高那知技品拉带油日部采头。油题身取体称发细亲命列取由。林好做难音当劳增节参路确该些前调出场。真手地适积过收物此农问许复。', 'rejected', 6, 3);
insert into comments values(null, '刘杰', 'p.wclics@beqdulwhx.il', '1994-08-19 01:55:50', '济中根当二日近济权带反成周照。开体流织业划任过效老如权题用拉群。说什整于他四就精油会专比进省证备。华基无过改带便加通单影集通者运议东。', 'approved', 8, 6);
insert into comments values(null, '萧超', 'd.bfkhn@zhfiqod.jp', '1994-10-14 00:46:45', '认门直认织电着民思须党求用。易土高向情连利保局县济式场当生。开热和标长话真开题干战中列算图住置他。', 'trashed', 6, 6);
insert into comments values(null, '邹勇', 'u.inugdgr@enlpiq.tr', '1994-11-02 18:51:25', '离东厂都运律精和比山决带引。适些派使太家可处加示究再亲今构查会候。传斯进加线正众求片统段技容。变达其增放者知于长才书是类音。', 'approved', 6, 2);
insert into comments values(null, '苏杰', 'u.ogbi@zeltedk.sm', '1994-11-11 10:31:24', '而利据主适无特才据世论规。展年去发号院究治部至东个本育群。类任路列除今员们选手照没复们权大与。', 'approved', 6, 6);
insert into comments values(null, '崔平', 'h.bjugjmeg@whcd.va', '1995-02-03 15:46:18', '可四群代角料又复许该值于电想产。加己她八最备于张生满院技难正毛。们格精号子维省马酸点角起边保导完。府干张取度况青传验建际民信。', 'held', 8, 5);
insert into comments values(null, '常强', 'w.qisdq@qjgew.cm', '1995-04-17 00:19:29', '才好极但今决已须在而段样件质取义儿事。代处老素党文图因影一出压反京有热越养。保于参满线清以民活条图厂任报太。口所其革化要外真青百带七有公门调。', 'approved', 6, 1);
insert into comments values(null, '曹勇', 'q.lwrbt@rcvovdaqo.ni', '1995-05-10 22:35:44', '少根专管做采直规把调状团心完么。快很交布子器毛北别角加到厂应属解她。全属时打器感争程技每别进通。身现比属权工动先变世使全头。', 'trashed', 3, 3);
insert into comments values(null, '武秀英', 'b.hgvdor@crrew.org', '1995-05-20 14:37:09', '之斯线列公心难有打群十委很物处两方。流划么常确于见局亲切克入段在。新类则在能构义因根资根界统图。力候际什布节老论度给题所县许来酸原。', 'held', 7, 1);
insert into comments values(null, '白敏', 'b.dvvahoen@csbqdmvbtp.cy', '1995-05-22 06:28:06', '又最它平军过众连事金以适时更又起。回查新界备或她采较活千住省结记。术热全教不过已民照年率于会所。', 'approved', 9, 3);
insert into comments values(null, '江秀兰', 'f.jkodkgnuwp@dxp.wf', '1995-06-01 08:30:47', '美美现第热系新每国头它转斗了八政。干红有平四期图民们马看周养节快。百光周每议国都并写南周教前界。月提称眼指厂加院真料回于理。', 'approved', 2, 4);
insert into comments values(null, '孔秀兰', 'k.cydhbftwb@jsvaj.sd', '1995-07-20 14:43:23', '质单石计子定原最究得加交调发受。元意意效流是复多容事它量压。思打得和备导世县红气院务。', 'held', 8, 3);
insert into comments values(null, '谢刚', 'i.sxujanyfn@fewqz.gb', '1995-08-31 23:57:50', '元大应报去所交属政花养组感这在价头。空土中没规严一品经团在使四构利把。府领利情花增四结表每价品于重始。价强再更容示代然线那选出局理月会们时。', 'trashed', 7, 1);
insert into comments values(null, '姜洋', 'f.ukxbfdi@kfpwmerw.au', '1995-09-15 23:02:32', '然断做飞象三业局习实真去集特速今深。太以想原特才细时口广今向须月成办头全。生可信见型整保义般了就其为进。论制线她性果眼需线空选领技其划便族。', 'trashed', 1, 1);
insert into comments values(null, '易强', 'q.fupoevyx@tpjtc.re', '1995-12-27 23:49:57', '听如热到市界声边放称争细回派省到。除和层指示她关示往立入除多期议期克。产阶然面将会水断口内造除标强样。而物重位这行离省没色较写。', 'held', 7, 2);
insert into comments values(null, '贾秀兰', 'p.ebrgpaw@ercyb.pro', '1996-01-08 05:26:27', '少六着车西指后领代包片题。给法酸只交位需看该列定片口圆。变空总压象布常满头给亲阶北去组都。据百力效九样们情意即低强何族。', 'rejected', 9, 6);
insert into comments values(null, '卢秀兰', 'i.pod@hbdlfkbg.ba', '1996-04-30 23:15:26', '表种在原样查也究量值之为压般半新。很深证采身清接火术见权们活国。传权书经主较意市完才空学此。华半没九书内近根么精走再候去压先。情王参查油选日性则阶算知存应先使元期。', 'approved', 6, 5);
insert into comments values(null, '马娜', 'n.ufkztl@bhfwxt.sk', '1996-05-02 17:38:01', '六际然拉会改就时水白军根土府段亲。除写县法始合等然决是影才热。特命权圆并张看标重上识复联。联资到色研团建严着状如角深值二。', 'rejected', 2, 7);
insert into comments values(null, '王刚', 'y.denwdy@mdnruvlyj.pf', '1996-05-05 11:03:58', '中么前单验标必放还持些题结真发内。生至理持名日实从求成意动复。商白约特连压还列听业为院具识达法。第风其而品较要机整决单成细强。', 'approved', 5, 3);
insert into comments values(null, '常秀兰', 'p.slvuv@hcrpf.cg', '1996-06-01 21:29:25', '动级包山级先公她争要装构小从。运动分教需广院各质度心称才适数过金。向意门适正路色些科进律列二。小不战市及开四治青活子学观持所内们习。', 'rejected', 4, 6);
insert into comments values(null, '万洋', 'r.babkeifneh@somrfki.td', '1996-06-03 19:30:27', '给满广织治除听几近装间时文支。看了该记省动角务国铁直化况提素还。积究候么始正就年前史第生严方入行。力运究作好活争细装制建叫二能。', 'held', 9, 5);
insert into comments values(null, '谢超', 'l.dhc@iuhdgvcx.ru', '1996-07-02 17:50:44', '支离往省长果西重委区量果年路用感圆志。置据里量约制成转易酸目区装总快料共有。写部层适义军西头织识除认变作。', 'rejected', 5, 1);
insert into comments values(null, '于杰', 'b.dkirxk@qyzqwup.aero', '1996-08-06 07:21:48', '第科示领音名我来话下查子段县战。今之立压持家酸起车进及可且革南。用况始火重下反国大时很人形统。数将听越太算精层革议件提员。', 'rejected', 3, 1);
insert into comments values(null, '唐超', 'j.kemcb@hdoif.az', '1996-09-14 05:49:25', '太局今处斯生专命见局七起就之表整单。资克光革专次效月许细同品。完因色省如总该着且持影维。联加说任置说酸思群别气性型角火。', 'rejected', 7, 3);
insert into comments values(null, '胡明', 'n.cifymiln@xyqhxtvhyh.org.cn', '1996-09-23 17:45:27', '易常多红对众来温传米王称角价书头东。把南度外些天看向员半场名。把率位选些者主管山织中候近被张。定米单清称业小道入所七志和元精器积非。', 'approved', 3, 6);
insert into comments values(null, '傅娟', 'i.nwjhj@yzyconz.mobi', '1996-10-16 08:05:32', '广压办平到收清新成是见器引土分正常。议正算业广二眼果无回性体五门。题不任比办压近越产单那酸区走很须活。很或做据有压子与国五打万工收。龙响有前根列见还影下物今市原龙观里。', 'held', 7, 6);
insert into comments values(null, '苏勇', 'k.xxeazbd@icxeo.nt', '1996-11-04 22:35:17', '口解间难小据委查林里空间低北安据法能。府现天眼民放委安你维发了地更受六采。用些强价专十战角厂京信文四走。', 'rejected', 8, 1);
insert into comments values(null, '顾磊', 'k.kydnpcpno@mwpgh.cd', '1996-11-29 01:44:11', '研力第定角究保生极设史大状地下眼调。种确济四切水清府形切名年那化。置各华间管听民规在无则油则但给人法府。工斯算做公们增又议书次用织利高分。', 'approved', 3, 2);
insert into comments values(null, '于丽', 's.mkbjpieib@lyhssxr.edu', '1997-02-20 18:48:28', '好志至称所解事队被几非现。角度亲快义人接再间该对西包提。常生线产名压些条利安团需前。些近也叫合格响关分派叫西每示再易。队教里布温题性务群打调目圆八。', 'trashed', 2, 7);
insert into comments values(null, '宋秀兰', 'q.pscwso@wjwjvwrks.ve', '1997-07-11 07:00:39', '华斗须十样天型心且务价土般合。作器的性二能交情求农入史场。及清百极们交或规进到样构研。商入再还想金山百较认式领该该研五。需十新标平九离要头管少时感义业身。', 'rejected', 6, 3);
insert into comments values(null, '蒋刚', 'q.dzubhmyq@mqcztqbw.cl', '1997-07-13 16:13:24', '志会教大象满听应阶口军提变对式。引转原量热参半指中世造世积适面安无革。条直社完工点七却却全商身使想。基响果习见上劳干族定理山。', 'rejected', 3, 2);
insert into comments values(null, '朱霞', 'x.ake@geqfhjkpm.fr', '1997-08-18 18:59:31', '题消务口务到十越毛表素太习易第养。存几指正题日温日来打高机。增五战如们时意义安力加效传华积权。观活步构起其值住文少八米。', 'trashed', 6, 2);
insert into comments values(null, '杨霞', 'o.nqhmcrfaq@iyyangqmjt.sb', '1997-09-24 02:30:59', '入文号路管场书更应安民象议始原则。或据指些全样三切战立张东放好话院。很连全什方如派步温导质林程力与能才。即全由满专社进土容组们基天始中点。查空术前光整回部组队所准林世值政。', 'approved', 8, 5);
insert into comments values(null, '程强', 'g.gajoyui@qemyucuje.bw', '1998-01-01 16:11:27', '研根速安期具技张车太她南划市每快原。段维给们装周统适通实门感好实道土。单内设片进内毛色中并的大花。张又体被年却较界外织近系表重。', 'rejected', 1, 1);
insert into comments values(null, '张刚', 'v.gtgvgt@obylcfncp.ht', '1998-02-12 14:14:20', '再就验选好将同般眼素形型生基众走王。酸党放维约响位斗织报半更阶性党张。水两于每准备铁无将问的出力。积表物还二与切政交科以八效技。', 'rejected', 8, 7);
insert into comments values(null, '朱军', 'b.lrpommf@rljwhjvrp.ye', '1998-03-30 13:13:58', '则已京划证资技争拉求去事回将果率。常其劳维风米光大如路火界价复长统。布观表定同更她作已适广细心达各达活。率志易新身反备具决团他八准层。', 'rejected', 8, 5);
insert into comments values(null, '叶娟', 'j.xzponrjc@kqqgwnwhco.tk', '1998-06-20 17:53:49', '样话较声经问你科又十引也来条美。话先完周与还从需知厂联转片个四。得金别参想连由那你车今天接状半。感高影受二中再明己联历素二表立热。', 'approved', 5, 7);
insert into comments values(null, '薛杰', 'z.gqivxm@ricwwspjpd.mq', '1998-07-04 00:11:02', '下满县教积断安规今气之科术在精。地记世京铁行工毛教几全来任不除别。什消养日布己写性率府水位。开反电革写目性热天提养天史义。解天委角严员史被石精备流平点质示构。', 'rejected', 3, 7);
insert into comments values(null, '黎霞', 'i.odf@qienhhl.sb', '1998-12-18 17:34:55', '山改流中确委历音才点感步次成关。它还解想叫县信近劳传门些示必林四传党。天子了龙为别你种包政成即化消度影组。必共位化说进则定东间中证派关条值拉。究那带理需直天间面很如华断龙。', 'trashed', 5, 5);
insert into comments values(null, '袁娜', 'n.fkivigez@opglnol.hu', '1998-12-24 03:25:40', '十一人原亲话题热易五院安见议斗矿平因。么气飞品角养习还这查三更真七起政。求得完来多化日什土认调史期后发。每立格全强政级种验话提非千第加。', 'rejected', 4, 6);
insert into comments values(null, '毛洋', 'x.hjfhnv@rglyx.pk', '1999-01-12 19:10:02', '回积北院小知按研太切需目步天术。速候话有二响上知收近据边算米。世明国运是面音质设无厂红经子济明或有。车矿军种该时断约到比影认都命速党面。', 'approved', 2, 5);
insert into comments values(null, '唐秀兰', 'b.pebfve@trkiuzcuse.mc', '1999-01-31 02:34:33', '从战那万广称战复具天治决教。件济性代都条带院保流两干律南派。验百许各器除集即改被段员权问。', 'approved', 8, 5);
