insert into comments values(null, '姜丽', 'l.bsvusl@dcjzxxgj.gw', '1999-05-29 16:19:46', '少却利天形月深现全之明认叫。发素样办压亲后先张花眼安院提快术在安。始拉展效划王生那步易当从更子低水好按。即习半技会题易江整规指你厂活。', 'rejected', 4, 5);
insert into comments values(null, '郑超', 'r.vkptryqb@mpcjt.my', '1999-06-15 04:51:33', '生领花基联成把领品子非角统教转社按。据技识年性次身专两作表越。间利须口米和布地化院文空查领。', 'trashed', 6, 4);
insert into comments values(null, '段勇', 'd.lxend@jrnvttiv.sk', '1999-06-28 17:34:43', '后之而口度少计次备西心可界织千美但明。目用划且白选素了九日里队党增。片特无置别电太红系你克究去小飞次。划料维行革去具圆效安合安她同列。', 'approved', 8, 2);
insert into comments values(null, '陈强', 'm.yqbc@vtt.fr', '1999-08-12 06:58:02', '温如四府导量山计选周金被交。局研头由由圆毛每收义力内水。别文共素又状起音感百素己规光土始深派。', 'approved', 9, 2);
insert into comments values(null, '赖强', 'a.fksrtxk@ywijqmo.sa', '1999-08-17 00:29:21', '叫家共实快每酸克称适统能照物所。观大律数与织将身立北研斯。时们选下论矿们果克同料易争果理名造。问何土强争斗格人节些切各此。', 'rejected', 8, 3);
insert into comments values(null, '黄强', 'x.eko@vgxc.cf', '1999-09-18 12:41:58', '党发回被场有委小局写要备立受志目价。运装价可影来入矿指于目导。当平会般率专史几教毛术几达习劳正严。压志界安调保京政素理道求地族者回关。', 'trashed', 8, 4);
insert into comments values(null, '朱艳', 'v.vfhtjflss@mvcspbwm.fk', '1999-12-01 14:41:06', '包华育治反小展气标老里程称权干。众该期本意自便转采九拉般度争常导。列象集证几常走能便习论被结石解响温织。人交风色人没半老直话做集包月维。', 'held', 10, 6);
insert into comments values(null, '谢艳', 'k.jgsxoalqe@trauw.name', '1999-12-03 05:39:26', '精派做部都温较斯必事油信广众。百动千下工通行需路十用克历确记根质。件管路深段酸多用低都电半北质海。速争断子使治史期系少全区到。', 'trashed', 7, 4);
insert into comments values(null, '史娟', 'u.bxzgbwpps@imqjs.pr', '1999-12-07 14:44:15', '众就里有调真示反全式起级研着际受结地。面三格次条她解质义住关处表改同据。众队较期学程多压我收住最属与。求济来七识变员支消马元表流列标相低。', 'rejected', 2, 7);
insert into comments values(null, '邓秀英', 'm.lvpbp@ktpgp.st', '2000-02-20 08:06:29', '北史型不根相现四展世与际下本。布出相阶属响调数包治生复义入。学解收些见细表万步北用华况备。将八身所月无温正机学劳战近还号变会系。', 'held', 5, 2);
insert into comments values(null, '邱秀兰', 'v.odhyzwfdp@ofgv.cc', '2000-03-02 09:39:10', '人次根下可出儿取数军做总龙身外形都。满水力例深府整观便被气争问并。之名收速革观拉济经至马位事价华京红们。容例号加层京即求重手合革油所领海。', 'rejected', 5, 3);
insert into comments values(null, '邵超', 's.axsqhb@foivdsopp.asia', '2000-03-13 23:06:03', '火效局热立立拉第商象能海心革民。无回具好由由统达今建适识其法置。点心接需但就下起发王支养边己型理常经。', 'trashed', 4, 4);
insert into comments values(null, '杨霞', 'g.nrybruns@jec.lb', '2000-04-06 16:49:55', '队响内观内放关该规线由边识严。月白度土术众而没只常空能。能新角很层些许更转身亲原位员约商示。', 'trashed', 7, 2);
insert into comments values(null, '龚霞', 'd.jgiohylz@swqblzppq.biz', '2000-04-10 22:17:09', '文文经南总儿外表成化但同接产。红色验等政有消议越方道因主打你安。只去色直受马流保斯由种九间下便。特观切八变话更厂决老派提后料权图二。', 'rejected', 3, 4);
insert into comments values(null, '唐杰', 'u.cqfopksk@qewsocrdh.sh', '2000-04-11 01:53:16', '天省将他千白计及养话么眼开何几向界。真此当整长政片长保此片比要头天。革主提林回家些自八加布干每任三因。', 'trashed', 6, 2);
insert into comments values(null, '林刚', 'y.ratu@yxeo.ae', '2000-04-30 07:54:39', '但油东置用最变们九八青农这界深党利。相小省安过较全此情风化强年并号属。低率况表些状军持集车包真周米容。主反西观产知形下属照过按叫做品后油。', 'approved', 8, 7);
insert into comments values(null, '杜秀英', 'w.gykemvkrm@cxmxfhvv.re', '2000-05-23 03:37:17', '才条素级张公严日非提上级几。实方江参布特常列县量并确易几常近。她产山器分阶把按革统原是与离所日大。路平放空道土院看由备划般组。', 'trashed', 4, 1);
insert into comments values(null, '康敏', 'e.nfobdtgbx@ixpku.km', '2000-06-24 19:27:49', '体史她装已使她权计江布图。难干运信间装响清照石小连细构品适实值。今目参主人维效存别青少专受今。', 'approved', 8, 3);
insert into comments values(null, '孙刚', 'h.esnk@plvnvphw.sb', '2000-09-17 18:14:00', '化元称是立解东生速第千多叫带。个委进技斯全即亲世内设听阶力。厂酸传化切果权开制明四场报间观强。应验法细往什示料却照计主你。', 'held', 7, 5);
insert into comments values(null, '丁平', 'g.ttlwr@iwvnuzg.jo', '2000-09-17 20:15:40', '变效利地太历约石中计龙强选少。声可难革战关圆收报化收由。队引往例达图农山种步后马。但阶形低院应适然铁成面入造并矿证。并反具龙来造根斗众对志直易农。', 'rejected', 2, 6);
insert into comments values(null, '江娟', 'n.qcerugs@rcxajwmmf.ie', '2000-09-18 00:01:28', '和我报党具克类在层难气百么办。月经得识细员中战质车响报得火展。回便包知精身却共光江圆专进情治。状参行然率列电热亲何山法向东领织观积。军点要值强许月通比团入题员能除。', 'approved', 3, 2);
insert into comments values(null, '范艳', 'o.hhben@dvtw.mh', '2000-09-24 09:15:22', '除离西权行而装制及说群声决消西。则气听资圆真时其经县置例强子半断近。无政况间条流此极眼同采今石主。者拉查论价就照至实改置习外开头争周。', 'approved', 3, 6);
insert into comments values(null, '刘军', 'o.oxxkqbw@siuzkrjcp.af', '2000-10-14 04:03:04', '社口位科明现门采数给速种日厂保往。象实子采体格少看思开变据反。十容定类军海分团东么越天热。手同知高决战义华至始好量适满强入。', 'held', 5, 5);
insert into comments values(null, '任秀兰', 'z.mjpxllkqs@frmve.bm', '2000-10-27 07:55:18', '眼大走业前确式平点例都时音过。制造设工出给图其土持界口每派同。者风利南更青七切要点己做天主具。位权况精万达据有再月新情放验主。', 'rejected', 4, 6);
insert into comments values(null, '姜敏', 'q.sbjddyv@rjhlpj.tj', '2000-11-17 05:30:39', '酸农约才增算越段八好亲只。新二育争根代头次方但证说斯。存大及低走何关式参理计规千建多明近克。少海例几表更易干响提精风常把且。', 'held', 9, 2);
insert into comments values(null, '叶平', 'e.cnvhwv@ddegnblk.ug', '2000-11-24 16:08:57', '加音值千打水高少时而海加克给积团。今能化意家列八决经西标西六业带社。置拉认在今长低色土论因除消那根头号情。见认今家联派系但南能根件运厂。江市市达车候产太类本增斗级如率采。', 'approved', 8, 4);
insert into comments values(null, '姚洋', 'r.lmcuxncews@mxpedoiyf.mc', '2000-12-05 12:20:11', '认书着已效化新委派保经和难。精手不能明建安标决切有无现级干。次厂什期国线太许般立及两使来处。命法量术七题进去直争便东南活划。', 'held', 5, 5);
insert into comments values(null, '锺桂英', 'n.lmgpx@pbik.ms', '2001-01-11 18:55:08', '史第细容照业型使政且那近面维先又。受度造都己可质除断性队放却。料切期清前计厂究前制分片入。战山局阶团资值书千四劳府例放。', 'rejected', 5, 6);
insert into comments values(null, '孟杰', 'x.mzjhbkp@srkjnwu.dz', '2001-02-04 06:20:58', '议果省这律六造样满相地满亲号计。油看至反维特干半化运级复物安教所较。不记划许众科约感路米事全商五。色器业划说真路出办外深容总意。', 'approved', 5, 2);
insert into comments values(null, '萧超', 'x.scxehha@bgrejxw.gn', '2001-02-13 01:40:26', '活子回了志角府历统示效系设起门矿。步王火状时两满矿斗个想拉采相效。小具心资积当起线清高头导声们取石。特外完号十则场系风类研政线际选。', 'held', 6, 3);
insert into comments values(null, '蔡丽', 'y.hzohh@rbmihj.dz', '2001-02-26 02:08:24', '委太总场阶天也多理都了它。积类构走片为社以必市院水界想物。七专元天维近与约单放好基到工。是大置提千京干满所准从极要不本此。济用党水应观题门化就而水须面公。', 'approved', 3, 7);
insert into comments values(null, '李军', 'd.ybqyhuq@nxfsrt.tv', '2001-07-17 08:22:14', '自写证观立特行适思查后知天地许己。委使进九着段整回各级习产量无今千。叫安图真参十地结群而行二导经阶。', 'held', 1, 6);
insert into comments values(null, '钱勇', 'o.fzp@gpjseyjtc.dj', '2001-08-12 01:28:53', '等况民被接至干容号须较好手权严务济少。原圆元表质和装张后主文属听。级九农当千千开已是说根示者火达和。流张二毛你为白工问光七事。示北种年标再意放民样被住。', 'approved', 6, 3);
insert into comments values(null, '石涛', 'j.sdbk@rfqia.am', '2001-11-06 05:52:33', '于适事特已示具共取类上天严。政太派料走地出新于维难已外米知广引。术四各六增生热专中日断示种。平需定生解白值受理亲社决率段六。派必照或美解小因作较今体。', 'rejected', 7, 5);
insert into comments values(null, '康强', 'p.ugugvvl@jyyqt.uk', '2001-11-23 07:13:32', '圆层连听民决并十状府管县六。信经四六青儿交现三根看立月运被精。产张明层过省却同光她究话资象。影些月色装装土从济验克国大。', 'rejected', 4, 3);
insert into comments values(null, '龚敏', 'j.xfebfahqj@xutyymo.gy', '2001-12-01 21:53:28', '资式家条政研比民府直联际严铁干。各传教新层三织米根书极家适作去气次分。细中热才子治集次计产消志专据。两切增持酸工今值利大毛你改构。', 'rejected', 5, 4);
insert into comments values(null, '罗艳', 'w.uxalw@vff.mr', '2001-12-07 17:13:18', '整广放展以之该林深建人断劳明科此。京看实家百王那阶业及石务层要边经。打里全转全存院一但并适中步克节及基。看价华社极它律向位到计织全包两连。说列广除给西华消已水军十七。', 'rejected', 6, 2);
insert into comments values(null, '邵静', 'm.let@psad.et', '2002-01-15 05:15:16', '条方都细府事提特持特格县众压队可内标。国况马劳铁亲一美领要东需解活斗力保。儿民龙想部出商接现于处少关半。', 'approved', 2, 3);
insert into comments values(null, '杜强', 'j.fxgiiu@rylv.aw', '2002-02-23 13:29:15', '此存子海族八声织打格音安己任能价强。等角验广此张行组意业马应真代劳华何。往适代越位需速在部时天方计米场族一年。思值种广使色也代研华它实生保选。难在些应大了两研被酸亲快。', 'approved', 10, 5);
insert into comments values(null, '熊杰', 's.jpsrmfiu@kefo.sn', '2002-03-13 20:55:06', '族直决信门所专斯商该很期示解易取如。正阶九况标领究济整价去查百。而厂无热温那头式按并团社消按。厂矿据林按完拉认则京加党常千县白。', 'approved', 5, 4);
insert into comments values(null, '任刚', 'd.kyuqo@peqbs.as', '2002-04-19 09:31:54', '代素真部放全织类处面精题。林联状光直世造通力前却月各识。术特取且极立力元至道并接深人全或。必本历须复议半半比感论情适权米需表。', 'approved', 1, 5);
insert into comments values(null, '汤平', 'h.iffpdn@guuiyli.mc', '2002-05-03 05:11:24', '快需派边原情比方众并着调经。当再现又相京装飞争装段并市众。线清线也学两基压之道作形主少象。叫物采当影根那实则严根花对教准算型车。', 'rejected', 4, 4);
insert into comments values(null, '江秀兰', 'k.pri@lqovuis.mg', '2002-06-18 05:33:21', '具况农再其部办器具规广给矿万。油当适式张结出林至会品准引对。民称持写据果商道种机和号种代适风响支。容必集本计育题实南团建技。', 'approved', 2, 3);
insert into comments values(null, '林明', 'n.kwati@ikxu.gb', '2002-06-30 06:35:03', '非热通白住文这处历劳及九领给农得感。照术党科车美受由引今子候前加。学能而内速极子积通置象集或。', 'trashed', 6, 4);
insert into comments values(null, '蒋平', 'x.sioqr@kxpard.nf', '2002-08-19 14:17:16', '毛器之保毛管质难为照由心北下高开。门切容维听十际义红风员石明从管须积。证运些联自矿联电经一专斯北位放行业。着用求元步办角府想具需等历阶。', 'rejected', 8, 4);
insert into comments values(null, '曾平', 'j.mwoeekbhc@cpjrl.cc', '2002-10-08 07:17:52', '阶强马影写说期对中易离这权争海好争。进子起连织参级理入安给接至。素导一手条开照质中四天知时九。', 'rejected', 7, 2);
insert into comments values(null, '贺磊', 'y.osxs@ylyzewqee.sd', '2002-10-13 21:43:35', '那放身交音至办专交力王联。何时示调别些军达知争前被音果非。步律斗千应必美包况又进消。毛要期认技术解件何特法越运感。', 'approved', 9, 3);
