insert into comments values(null, '郭芳', 'l.ycmrcvei@dwxxo.us', '2002-12-27 13:34:01', '子总置电老度叫又约相大运写消今。上前打果团理度主石交东变空影片话。龙知总深广类题引果金没比却声经次。如气单照而容强人给做接想他表声。感效风金义斗里没养真门下育时高题。', 'held', 6, 2);
insert into comments values(null, '周霞', 'c.rexsdu@lrc.la', '2003-02-07 17:07:33', '林度新志日品利斗低拉写满级整代设。件采明常连气得华般统术种。外分行八将王机生务界都里色军物进边分。论越复权周约术确究值际儿海。', 'approved', 4, 2);
insert into comments values(null, '贺静', 'y.dmikh@oxkzefg.io', '2003-02-17 14:02:47', '克花织将一王流装公备百养器主。热元化但日料支除马素养便派满。半二府号带例西产平代部划书研新期们。海流同情大数业世强如路历价酸研月。', 'approved', 8, 2);
