insert into comments values(null, '黎勇', 'c.tdrjxedh@hejkdg.jo', '2003-07-14 13:20:13', '中运产路山被眼整林果图自象六存下标。易须至多又许领照且指立之及。状你走即历往先用极社带步证议角记。道两度共何没农月单广然记影。为联达门果任路场验当下便便军流。', 'trashed', 4, 1);
insert into comments values(null, '吴平', 'o.cjqrses@tpgsnoc.mr', '2003-08-18 20:30:13', '十广构用代照理更一引听住界点器。许办青高例然按红方县必元头火现又。为物根本眼个八深儿石以理红子地展。连有王几它权矿方许情党青。', 'rejected', 6, 4);
insert into comments values(null, '宋秀英', 'n.dwcimbe@zlpxhhglrl.tk', '2003-11-24 00:32:20', '使花连相派据值很法会展连部圆直。象类局温把出文理学每很龙。报按问山是空但再报克平制节放光三利走。价斗条算比量北着单能目次着与候真。', 'approved', 7, 6);
insert into comments values(null, '宋杰', 'r.hszclp@gsppi.ad', '2003-11-26 11:09:12', '重素化队同石权管新做叫千农品对研金。斗义力切金包几克些中情干认没示万。红己引决反派音市感只性省决于共。事层还日导发角下越反光同通事用将只。', 'trashed', 9, 5);
insert into comments values(null, '吴平', 'o.jltymgu@hbpok.as', '2003-12-14 13:29:23', '其出工深你压包易农业写解六信南油府体。基青图飞前头商长资被质山这。级带大院清个且题情根米正细这志说机。从长影快法农行但战么毛平深。', 'approved', 8, 6);
insert into comments values(null, '胡敏', 'c.ioy@lhbtflwi.nz', '2004-01-11 20:04:22', '持书议光转育品参林委美切工人。张海亲方委此六也并记战应就义年积。种号段题气更样维团至极务党花信。这技数单根什装军示被相自件题子。劳真位专组度严带到口党四总满查合阶面。', 'approved', 6, 4);
insert into comments values(null, '萧军', 'r.zqiejkedd@hfsxkia.sg', '2004-02-14 09:37:16', '规就口干个基组想期大毛易与细对。特体素我管国我受往酸性自。价文济电义被被造议复半里任里步整林。龙但军龙又过听劳离积使过称界段布。', 'held', 9, 3);
insert into comments values(null, '毛静', 'n.qeibnj@axzwc.gy', '2004-04-28 10:04:11', '气行飞你支取住通火会它处。各料二他青速之你达深百参专叫两。小工以社越运备去为阶将无共际后阶。又压难布斗带角其整处要精口际派记标下。务消那广结影是专们前最共成政连府。', 'trashed', 8, 7);
