insert into comments values(null, '汪强', 'h.gtxrduyd@fxhjjnv.bd', '2011-07-30 16:54:51', '花处识习识消量起将军油体两此米是别。队队来金世生当着步家指象引你切定后习。却更便与好价维温入便管属。达五得算习世适种此办入期候领期当时。', 'held', 6, 2);
insert into comments values(null, '孔娟', 'd.tdxec@okishripb.tk', '2011-09-01 21:09:41', '斗无十得声加料速按于计千标。候么整取算起观革热只开先增取月。国商下要阶体自说变内放热商斯影号。设半保回今志她机制速市情线土据。当个十立对采提自选完在称住院。', 'trashed', 3, 6);
insert into comments values(null, '陆杰', 'd.oetjymilbi@duheev.pm', '2011-09-07 05:04:14', '了音入严导北出事示众便易历然。写以委始全图始们向设此他革验证较记好。能少将保开技应议儿如毛北出两节。速种非上说改毛连京维克解重派原果家。期取统由亲名约验物深改集报际历水识天。', 'rejected', 4, 3);
insert into comments values(null, '李军', 'g.seghpj@arhpmj.tp', '2011-10-14 16:09:20', '米以具机公地文式低门年步要该位料水为。线农须度数目三水强维存来说进快流时。关发亲走体须置石采把构反名。事心格次取安更酸龙无干问离。', 'approved', 9, 2);
