insert into comments values(null, '唐娜', 'l.gan@odw.mn', '2013-03-20 16:17:17', '度里备每与商确速严片发拉类压社压。型此见转天年活回单验此共分。书变体具长段根家内却战气广己民影他。程实研国料深力家及造世合。头料果观华其集政本期维在类己话。', 'approved', 7, 3);
