insert into comments values(null, '赵芳', 'c.wck@jbzjxk.fr', '2016-04-11 12:12:31', '土命心管办十走知作单好学不资克三土。格石结风单别说律强决电手酸很工路报有。族单业向同参复目人基原具太。明快结住土细许开部体公太南月。', 'held', 4, 6);
insert into comments values(null, '贺秀英', 'p.crpyg@fkiqsxhxr.ck', '2016-04-19 00:14:30', '布因里求住立用再看劳去花心六。色还组林易指无被利量开对志指派间因。状达成个动号动上没增接口。局北分科水工关及出断空共方北须细矿资。几能问但级日学也导第构收断想公思。', 'rejected', 10, 6);
insert into comments values(null, '贾军', 'r.rxeq@wedug.wf', '2016-05-18 09:50:58', '过热律飞回情强示几处持儿流收适。党重任状院人水式族切给周便北确。头头干得片管第断属记共许则利。公主展光断已层种社保手状反。', 'approved', 10, 2);
insert into comments values(null, '崔丽', 'l.uxemqcpdq@qhqruf.cq', '2016-06-13 10:11:51', '亲发等把程将革你头快开每即省即。济山和人己图打上得权收克。有收列之划百放革斗队经实月点处织快。', 'approved', 2, 7);
insert into comments values(null, '丁超', 'n.xhdihvr@qrovltppg.vn', '2016-07-02 23:58:46', '三农建学将亲属至此的十系。才信克业算出们许持强所技府。题先华平提来调社器起交县须见联头由。', 'held', 9, 2);
insert into comments values(null, '李平', 'o.uvnkagzpni@ubgsmpdja.gw', '2016-11-06 00:35:19', '装精解天型身天元可战相图直与结识。儿四酸方个长体照件需广时力划。就员的型群点党除声从院响红着代。具定系列元技类存多命太解设身也。', 'rejected', 8, 2);
insert into comments values(null, '吕娜', 'p.nudqvwu@kma.nf', '2016-11-20 18:16:41', '需存酸维带美带热引手话之织。参切外亲公方化事管按实院活。提在清何大始取每步高克约满土确。地院证只放电事回几只铁需族。', 'rejected', 7, 1);
insert into comments values(null, '叶秀英', 'n.spkwrgmxg@dnyhun.uy', '2016-11-22 18:46:27', '用运本团料年片头况东石系。看片改时易再由图通里起越周最然。酸眼完家实系越权多里先建织。', 'rejected', 9, 3);
insert into comments values(null, '曹洋', 'r.qfrad@kfksmioawy.mr', '2016-11-28 12:28:03', '机观基体亲开带际段达京现格深去没。度能干打历千命可信些非百技十题始求家。县全型教阶每地方具由打制听每情五收。选等养红铁品却因学带火山总属。', 'rejected', 8, 4);
insert into comments values(null, '曹芳', 'j.uferfdxee@skdzecrj.cy', '2016-11-30 12:51:49', '酸直从红思委思志身听体总公任。用因儿分进现据回整你从往实几。根县需角二少这六点等白集斗。器石工运则断取表育相断入备消计根流。', 'trashed', 3, 2);
insert into comments values(null, '杜杰', 'v.bojkocx@gevobll.ky', '2016-12-06 19:27:39', '角会际写布形力学然用严查通前。济调什角团争儿确活记果场斗引同系。效的社会例段所来适被白气叫。几取程究矿别酸者样容局东快这上。精满活验天青声导器展候县办张育员无。', 'trashed', 8, 2);
insert into comments values(null, '文杰', 'h.mnhzhtecm@sbis.cz', '2016-12-14 11:15:17', '定件新省参向称动自流圆统根也参业持。业看风切和许果属亲何眼安火特原。部的社头导复特增院理物里里内。快名什新方立革局所书论众向龙。', 'approved', 5, 6);
insert into comments values(null, '武艳', 'i.fuvmjuuth@twevv.tp', '2016-12-17 04:57:32', '铁求带立周省军农出龙是见例维带。类容去子会油长构严却研工。交音使县处志府她而么今空万了。', 'trashed', 6, 2);
insert into comments values(null, '武涛', 'v.flpf@mpjelo.sm', '2017-03-02 20:10:12', '想称总结级建因提市自资具文养战按确。江连或对叫确太至说管都老易界并马拉量。则除般其然便装作记证交论期共江地。节口中厂水现性美强变图响线心程于。', 'approved', 9, 4);
insert into comments values(null, '方伟', 'a.trmznxl@lhwk.net.cn', '2017-03-07 03:37:22', '太型道原边世子快必并只关代算。水她数土物规别此速龙老来指。它名工克标该都除感性干色什造火。什今圆事毛立影存加七少这。', 'approved', 8, 4);
insert into comments values(null, '汪超', 'b.set@qyafse.ca', '2017-04-17 04:02:25', '已界口将装里历三她业北离却。管龙日保得光我千容门看报各务水题。斗时广命法劳金们张在两商记气制。', 'trashed', 5, 1);
insert into comments values(null, '黎洋', 'o.fdzw@pou.mc', '2017-06-07 19:40:03', '上金平半斗交调万人行你员所六量。阶史经你构相也资其形些查元正任。都见边则内包自口了油将常处。', 'trashed', 3, 4);
insert into comments values(null, '程芳', 'c.imwvtr@rgz.mp', '2017-06-17 16:13:46', '龙办南信术和实严商称上市发间化。东重红之用属运新拉阶毛更条土引。比铁交干取族反数边号经积前东。满立别众义组产点要员处始应体前图酸。', 'held', 10, 5);
insert into comments values(null, '叶杰', 'z.hxaftlxt@cgqgyjya.tt', '2017-06-24 11:43:53', '资得界身省料品龙引才况团路精住单。志究育本再委压调划矿志划现党快。名具直调那所人号律见确造利。线阶要亲只收需易飞本族历转叫装根今属。率料家带动装只质始会元上精划车系治阶。', 'rejected', 9, 5);
insert into comments values(null, '赵勇', 'w.yygairrhr@oedyuoq.bg', '2017-07-12 22:01:30', '便队米开年权命最选图作市空北号。头金列直月影调已存还亲外活见。头全导写想放形运标七并记证调史是办还。五们引到原油红影布快求型。', 'approved', 8, 5);
